1457	La quantité de sperme baisse s'il y a plusieurs masturbations avec éjaculation à la suite ?	Oui, si une personne se masturbe et éjacule plusieurs fois par jour, il peut arriver qu'elle éjacule moins (ou plus du tout) de sperme. Son « stock » mettra plusieurs heures pour se reconstituer. Les premières émissions de sperme se déclenchent 1 à 2 ans après le début de la puberté. Avant ça, le corps n'émet pas de sperme.	\N	\N	2021-06-29 15:42:32.889+02	\N	\N	2021-06-29 15:42:32.893+02	2021-06-29 15:42:32.912+02	\N	37
1458	À ton avis, en moyenne, le clitoris mesure combien ?	Le clitoris dans son entier, le gland, le coude et les 4 ramifications, mesure en moyenne 12 cm.	\N	\N	2021-06-29 15:42:33.07+02	\N	\N	2021-06-29 15:42:33.074+02	2021-06-29 15:42:33.091+02	\N	37
1459	La quantité de sperme d'une éjaculation peut être contenue dans ... ?	La quantité de sperme émis lors d'une éjaculation tient à peu près dans une cuillère à café. La quantité de sperme émis ne détermine pas le plaisir reçu ou donné. Plus les éjaculations sont rapprochées, plus la quantité diminue et le sperme devient transparent : c'est normal. Attention, une goutte suffit pour transmettre une infection ou provoquer une grossesse.	\N	\N	2021-06-29 15:42:33.266+02	\N	\N	2021-06-29 15:42:33.268+02	2021-06-29 15:42:33.284+02	\N	37
1460	Jamais envie de rapports sexuels... c'est possible ?	Oui. Certaines personnes n'ont juste pas envie et c'est tout à fait possible et normal (on appelle ça l'asexualité). Il peut aussi s'agir d'autres raisons : pas le bon moment, pas la bonne personne, après une expérience traumatisante, manque de libido, le stress, etc. : si tu en ressens le besoin, tu peux consulter un·e professionnel·le de santé.	\N	\N	2021-06-29 15:42:33.472+02	\N	\N	2021-06-29 15:42:33.475+02	2021-06-29 15:42:33.495+02	\N	37
1461	Est-ce qu'il faut se raser les poils autour du sexe ?	Non, il ne faut pas forcément se raser les poils autour du sexe. S'épiler est un <strong>choix personnel</strong> et ce n'est pas plus hygiénique. L'hygiène n'a rien à voir avec les poils. En dehors de l'hygiène intime, celle du corps, celle des mains, qui sont recommandées : chacun·e fait ce qu'il·elle veut avec ses poils !	\N	\N	2021-06-29 15:42:33.666+02	\N	\N	2021-06-29 15:42:33.671+02	2021-06-29 15:42:33.691+02	\N	37
1462	L'hymen, c'est quoi ?	"L'hymen est une petite membrane de forme et d'épaisseur variables qui ferme plus ou moins partiellement le vagin. 3 infos à retenir :\r\n- 1/3 des femmes n'ont jamais eu d'hymen. \r\n- Cette membrane peut s'assouplir et s'ouvrir davantage lors des premiers rapports sexuels (ou pas). \r\n- Il n'y a pas forcément de sang lors d'une première pénétration vaginale.	\N	\N	2021-06-29 15:42:33.862+02	\N	\N	2021-06-29 15:42:33.866+02	2021-06-29 15:42:33.887+02	\N	37
1463	Il peut arriver d'éjaculer du sperme de manière incontrôlée la nuit ?	Le sperme peut parfois sortir de manière incontrôlée souvent durant le sommeil (ça peut arriver la journée mais plus rarement). On appelle cela l'éjaculation nocturne (ou le « rêve mouillé »). Ça témoigne souvent du début de la puberté et c'est fréquent chez l'ado. Ça existe aussi parfois chez l'adulte. C'est un phénomène tout à fait normal, et ce n'est pas sale.	\N	\N	2021-06-29 15:42:34.025+02	\N	\N	2021-06-29 15:42:34.027+02	2021-06-29 15:42:34.04+02	\N	37
1464	La loi interdit d'avoir des rapports sexuels avant 15 ans ?	Non, il n'y a pas d'âge légal : deux mineur·es peuvent librement avoir des rapports sexuels entre eux·elles. Cependant, un·e majeur·e qui aurait des rapports sexuels avec un·e mineur·e de moins de 15 ans, et ce, même si le·la mineur·e consent à l'acte ou au rapport sexuel, peut être condamné·e car ça constitue une atteinte sexuelle sur mineur·e.	\N	\N	2021-06-29 15:42:34.176+02	\N	\N	2021-06-29 15:42:34.178+02	2021-06-29 15:42:34.189+02	\N	37
1465	Une personne qui force sa partenaire enceinte à avorter, c'est illégal ?	Oui, il est interdit de forcer une femme, mineure ou majeure, à avorter. La décision finale n'appartient qu'à la femme enceinte. Le partenaire est là pour conseiller mais ne peut pas faire pression. Pratiquer une interruption de grossesse sans le consentement de la femme enceinte peut être puni de cinq ans d'emprisonnement et de 75 000 euros d'amende.	\N	\N	2021-06-29 15:42:34.344+02	\N	\N	2021-06-29 15:42:34.346+02	2021-06-29 15:42:34.359+02	\N	41
1466	Pour une fille, après un passage aux toilettes, il vaut mieux s'essuyer... ?	En se nettoyant de l'avant vers l'arrière, la personne évite la propagation de matières fécales vers la vulve, donc la propagation d'infections potentielles. D'autres petits conseils : ne pas pratiquer les douches vaginales (nettoyage de l'intérieur du vagin) car le vagin est auto-nettoyant et utiliser un savon sans parfum pour l'extérieur (la vulve).	\N	\N	2021-06-29 15:42:34.521+02	\N	\N	2021-06-29 15:42:34.523+02	2021-06-29 15:42:34.537+02	\N	37
1467	Les mains peuvent transmettre une infection ?	Oui. L'hygiène des mains est indispensable avant tout rapport sexuel, toute caresse intime, tout échange sexuel. Les mains peuvent véhiculer des germes : des germes attrapés après avoir pris les transports ou touché un téléphone, ou des germes fécaux attrapés après avoir touché un anus. Les mains peuvent aussi véhiculer certaines IST (chlamydia, gonorrhée...).	\N	\N	2021-06-29 15:42:34.78+02	\N	\N	2021-06-29 15:42:34.782+02	2021-06-29 15:42:34.792+02	\N	37
1468	La mycose ou candidose c'est une IST ?	Non, ce n'est pas une IST à proprement parler. C'est une infection fréquente et banale des organes génitaux par un champignon. Plein de facteurs peuvent expliquer son apparition (pantalon serré, VIH, prise d'antibiotique, pilule, diabète, excès d'hygiène, etc.). La mycose peut ressurgir après un rapport sexuel. Elle se manifeste notamment par des démangeaisons.	\N	\N	2021-06-29 15:42:34.973+02	\N	\N	2021-06-29 15:42:34.975+02	2021-06-29 15:42:34.988+02	\N	37
1469	Le retrait est une méthode de contraception fiable ?	Non. Avant l'éjaculation, un liquide pré-séminal peut s'écouler avec des spermatozoïdes qui peuvent féconder l'ovule : si c'est le cas, il y aura grossesse. Le retrait n'est pas une méthode efficace pour éviter une grossesse non désirée aux partenaires, d'autant qu'il peut y avoir des "ratés" (éjaculation précoce, retrait tardif, oubli de retrait dans le feu de l'action...).	\N	\N	2021-06-29 15:42:35.156+02	\N	\N	2021-06-29 15:42:35.157+02	2021-06-29 15:42:35.173+02	\N	37
1470	Un vagin peut être trop petit ?	Un vagin ne peut pas être trop petit. C'est un muscle extensible : sa dimension varie lors d'un rapport ou lors de l'accouchement par exemple. S'il y a des douleurs ou si la pénétration est impossible c'est souvent lié à la contraction des muscles du vagin ou au manque de lubrification (de mouille).\r\nConsulter un·e profesionnel·le de santé si ça persiste.	\N	\N	2021-06-29 15:42:35.357+02	\N	\N	2021-06-29 15:42:35.359+02	2021-06-29 15:42:35.372+02	\N	39
1471	Si une fille mouille, c'est qu'elle a envie d'un rapport sexuel ?	Mouiller ça ne veut pas forcément dire qu'une personne a envie de faire l'amour ou qu'elle aime ce qu'on est en train de faire. À l'inverse, elle peut avoir du désir sans mouiller tout de suite. Le mieux c'est de communiquer pour savoir ce qui plaît au·à la partenaire et exprimer ce qui nous plaît : on s'assure alors de se donner mutuellement du plaisir :)	\N	\N	2021-06-29 15:42:35.522+02	\N	\N	2021-06-29 15:42:35.524+02	2021-06-29 15:42:35.536+02	\N	41
1472	Est-ce que la virginité est liée à l'hymen ?	Non. L'hymen est une membrane qui n'a pas de fonction particulière. Il n'est pas rare de naître sans hymen ou que ce dernier se soit déjà atrophié (déchiré) avant le premier rapport. Il est aussi possible que certaines femmes gardent leur hymen intact même après avoir accouché. Un hymen intact/déchiré/absent ne dit rien sur la virginité d'une personne.	\N	\N	2021-06-29 15:42:35.687+02	\N	\N	2021-06-29 15:42:35.689+02	2021-06-29 15:42:35.702+02	\N	39
1473	On peut obtenir des préservatifs gratuitement ?	Les préservatifs peuvent être obtenus gratuitement dans les Centres de Planification et d’Éducation Familiale (CPEF), les Centres Gratuits d'Information, de Dépistage et de Diagnostic (CeGIDD), ou dans certaines associations spécialisées en santé sexuelle. En pharmacie, on peut obtenir des préservatifs remboursés avec une ordonnance d'un·e médecin.	\N	\N	2021-06-29 15:42:35.882+02	\N	\N	2021-06-29 15:42:35.885+02	2021-06-29 15:42:35.902+02	\N	39
1474	Pendant un acte, le consentement peut être à tout moment retiré ?	Le consentement est donné pour un acte mais il peut à tout moment être retiré. Si une personne ne veut plus, continuer le rapport sexuel est constitutif d'un viol. Si un·e partenaire veut arrêter, à n'importe quel moment, quelle que ce soit la raison, on arrête. En cas de violences sexuelles, on peut appeler le 3919 pour recevoir conseils, aide et information.	\N	\N	2021-06-29 15:42:36.089+02	\N	\N	2021-06-29 15:42:36.092+02	2021-06-29 15:42:36.109+02	\N	39
1475	Si on est mineure et qu'on veut avorter il faut l'accord des parents ?	Non. Il est recommandé d'en parler à ses parents, mais ce n'est pas une obligation. Les mineures doivent être accompagnées par un·e majeur·e qu'elles ont choisi·e. Elle peut se rendre dans un centre de planification familiale (CPEF), en parler avec un·e professionnel·le de santé ou appeler le 0800 08 11 11 (numéro gratuit) pour recevoir de l'aide.	\N	\N	2021-06-29 15:42:36.252+02	\N	\N	2021-06-29 15:42:36.253+02	2021-06-29 15:42:36.264+02	\N	39
1476	On peut attraper une IST sans pénétration ?	Oui ! Les IST peuvent se transmettre lors d'une fellation, d'un cunnilingus ou anulingus, lors de caresses, de frottements intimes, de contact entre muqueuses, y compris sans pénétration. Pour se protéger, on peut utiliser un carré de latex en le plaçant sur la vulve ou sur l'anus, ou un préservatif lors d'une fellation ou lors d'une pénétration.	\N	\N	2021-06-29 15:42:36.451+02	\N	\N	2021-06-29 15:42:36.453+02	2021-06-29 15:42:36.468+02	\N	39
1477	La pilule protège des IST ?	Non, la pilule contraceptive ne protège pas des infections sexuellement transmissibles (IST). C'est un moyen de contraception hormonal qui protège seulement du risque de grossesse. La pilule d'urgence ne protège pas non plus des IST. Le seul moyen de contraception qui protège aussi du VIH/SIDA et des autres IST, ce sont les préservatifs (externe et interne).	\N	\N	2021-06-29 15:42:36.691+02	\N	\N	2021-06-29 15:42:36.695+02	2021-06-29 15:42:36.716+02	\N	39
1478	La cyprine, c'est quoi ?	La cyprine c'est l'autre petit nom de la mouille. C'est le lubrifiant naturel du vagin. Elle est généralement le signe de l'excitation sexuelle et peut faciliter la pénétration lors d'un rapport. En revanche, quand on utilise un préservatif externe ("masculin"), il est conseillé d'ajouter du lubrifiant sur le préservatif car ça diminue les risques de rupture.	\N	\N	2021-06-29 15:42:36.917+02	\N	\N	2021-06-29 15:42:36.92+02	2021-06-29 15:42:36.94+02	\N	37
1479	L'herpès génital touche combien de personnes en France ?	Environ 2 millions de personnes sont touchées par l'herpès génital en France. Il peut rester endormi pendant des années puis apparaître plus tard. Il est très contagieux pendant les poussées qui se manifestent par des picotements, des vésicules, des brûlures, des blessures près des organes génitaux. Un traitement existe pour empêcher les poussées.	\N	\N	2021-06-29 15:42:37.142+02	\N	\N	2021-06-29 15:42:37.146+02	2021-06-29 15:42:37.163+02	\N	41
1480	Si on a une IST on le sait forcément ?	Non, les personnes porteuses d'infections sexuellement transmissibles (IST) peuvent ne pas le savoir car il n'y a pas forcément de symptômes visibles (pas de douleurs, pas d'odeurs, pas de gênes etc.). Les dépistages permettent de savoir si on est porteur·euse pour si besoin : se soigner, éviter des complications et ne pas contaminer d'autres personnes ;)	\N	\N	2021-06-29 15:42:37.368+02	\N	\N	2021-06-29 15:42:37.37+02	2021-06-29 15:42:37.389+02	\N	39
1481	Le liquide pré-séminal peut -il provoquer une grossesse non désirée ?	A l'état naturel, le liquide pré-séminal ne contient pas de spermatozoïdes. MAIS, il peut entraîner avec lui des spermatozoïdes qui étaient présents dans l'urètre après une précédente éjaculation. De ce fait, une pénétration, même sans éjaculation peut parfois entraîner une grossesse.	\N	\N	2021-06-29 15:42:37.553+02	\N	\N	2021-06-29 15:42:37.557+02	2021-06-29 15:42:37.581+02	\N	39
1482	Le vaginisme c'est... ?	Le vaginisme désigne une contraction involontaire des muscles qui entourent le vagin. Cette contraction involontaire rend la pénétration d'un doigt, d'un pénis, d'un sex-toy, voire même d'un spéculum impossible. Si on force, on peut ressentir de vives douleurs. En cas de douleurs, on peut, si on veut, en parler avec son·sa médecin car des solutions existent.	\N	\N	2021-06-29 15:42:37.76+02	\N	\N	2021-06-29 15:42:37.763+02	2021-06-29 15:42:37.776+02	\N	41
1483	Les vagins aussi pètent ?	Le pet vaginal, c'est de l'air qui sort du vagin. C'est surprenant ! et parfois gênant... mais  ça ne devrait pas l'être car c'est tout à fait normal. Le pet vaginal survient lorsqu'il y a eu une entrée d'air dans le vagin (en général, lors d'une pénétration). Il n'a pas d'odeur et certaines positions le favorisent.	\N	\N	2021-06-29 15:42:37.934+02	\N	\N	2021-06-29 15:42:37.936+02	2021-06-29 15:42:37.951+02	\N	41
1484	S'épiler le sexe, c'est quand même plus hygiénique, non ?	Non ! S'épiler est un choix personnel et ce n'est pas forcément plus hygiénique. Donc, chacun·e fait ce qu'il·elle veut avec ses poils. L'important est de bien prendre soin de sa toilette intime, de l'hygiène de son corps et ses mains. \r\n\r\n(Attention, les poils ne protègent pas contre les infections sexuellement transmissibles !)	\N	\N	2021-06-29 15:42:38.098+02	\N	\N	2021-06-29 15:42:38.1+02	2021-06-29 15:42:38.111+02	\N	41
1485	L'orgasme c'est quoi ?	C'est un plaisir sexuel intense entraînant une brève perte des sens. Il peut être accompagné de l'accélération de la respiration et du coeur et de contractions musculaires involontaires. Il n’est pas évident d’expliquer ce qu’est un orgasme car les sensations ressenties dans tout le corps varient d’un individu à l’autre, ou d’un moment à l’autre.	\N	\N	2021-06-29 15:42:38.265+02	\N	\N	2021-06-29 15:42:38.269+02	2021-06-29 15:42:38.29+02	\N	37
1486	Quand on est gay, on doit forcément pratiquer la sodomie ?	Le fait d'être gay n'implique pas de devoir pratiquer la sodomie. Il y a d'autres manières de vivre sa sexualité en dehors de la sodomie. Si on ne veut pas pratiquer la pénétration anale, on en a le droit, et le partenaire ne peut pas forcer, ni obliger, quelle que soit la raison : les deux partenaires doivent désirer cet acte et être consentants pour le faire.	\N	\N	2021-06-29 15:42:38.479+02	\N	\N	2021-06-29 15:42:38.481+02	2021-06-29 15:42:38.495+02	\N	39
1487	Le sperme contient quoi ?	Le sperme contient notamment des spermatozoïdes et le liquide séminal. Il contient aussi en <strong>petites quantités</strong> des nutriments et des protéines qui maintiennent en vie les spermatozoïdes pour une courte durée. Si on a attrapé un virus ou une bactérie de type IST, il ou elle peut se trouver dans le sperme et se transmettre lors d'un acte sexuel non ou mal protégé.	\N	\N	2021-06-29 15:42:38.649+02	\N	\N	2021-06-29 15:42:38.651+02	2021-06-29 15:42:38.668+02	\N	37
1488	Orgasme / Jouissance : c'est différent ?	Oui, jouir n'est pas orgasmer. La jouissance est un plaisir ressenti dans son corps. L'orgasme est une jouissance sexuelle intense qui fait perdre brièvement la perception des sens. Pas besoin de faire de l'orgasme une obsession : on peut prendre du plaisir sans ! Mais en explorant peu à peu, chacun·e son rythme, ça viendra à travers la connaissance de soi.	\N	\N	2021-06-29 15:42:38.839+02	\N	\N	2021-06-29 15:42:38.841+02	2021-06-29 15:42:38.855+02	\N	41
1489	Le vagin a un pH proche de celui de... ?	Le pH moyen d'un vagin équilibré se situe entre 4 et 4,5, soit à peu près comme une bière. Les variations du pH vaginal peuvent entraîner un déséquilibre et des infections telles que des mycoses. Plein de facteurs peuvent l’influencer : antibiotiques, toilette mal adaptée (douches vaginales), règles, sperme (le pH vaginal augmente pendant un temps avec le sperme), etc.	\N	\N	2021-06-29 15:42:39.077+02	\N	\N	2021-06-29 15:42:39.081+02	2021-06-29 15:42:39.101+02	\N	41
1490	Avoir un orgasme pendant un rapport non consenti, c'est la preuve du consentement ?	Non, l’orgasme peut être un moyen de défense adopté par le corps lors du rapport sexuel non consenti. Cela reste un viol car il n’y a pas eu de consentement à l’acte, même s'il y a orgasme, même s'il y a mouille ou même s'il ya érection, par exemple. En cas de violences sexuelle, on peut appeler le 3919 pour recevoir conseils, aide et info.	\N	\N	2021-06-29 15:42:39.282+02	\N	\N	2021-06-29 15:42:39.284+02	2021-06-29 15:42:39.297+02	\N	43
