1492	Le VIH/SIDA peut se transmettre par la salive ?	Non, il ne se transmet pas par la salive. On ne peut pas transmettre le VIH/SIDA lors d'un baiser. Le VIH se transmet lors d'un rapport non protégé avec une personne séropositive qui ne prend pas de traitement, par transmission sanguine ou lors de l'allaitement d'une femme séropositive à son bébé.	\N	\N	2021-06-29 15:42:39.647+02	\N	\N	2021-06-29 15:42:39.649+02	2021-06-29 15:42:39.662+02	\N	39
1493	Être homo et être trans c'est pareil ?	Un·e transgenre est une personne dont le sexe biologique, assigné à la naissance de façon binaire sur l'observation de ses attributs masculins ou féminins, ne correspond pas à son identité de genre, c'est-à-dire à la manière dont cette personne se sent et se définit. \r\nÊtre homosexuel·le est le fait d'être attiré·e sexuellement ou sentimentalement par une personne de même sexe que soi-même.	\N	\N	2021-06-29 15:42:39.839+02	\N	\N	2021-06-29 15:42:39.841+02	2021-06-29 15:42:39.854+02	\N	41
1494	Un•e mineur•e peut être condamné•e pour viol ?	Oui. Le viol est puni par la loi, y compris quand on est mineur·e. En cas de crime ou de délit, un·e adolescent·e doit rendre compte de ses actes devant la justice. Selon la gravité des faits le·la juge pourra prononcer une mesure éducative, une sanction éducative ou de la prison. Donc, si un·e mineur·e viole, il·elle peut être condamné·e.	\N	\N	2021-06-29 15:42:40.016+02	\N	\N	2021-06-29 15:42:40.018+02	2021-06-29 15:42:40.032+02	\N	39
1495	Une IVG c'est une infection vulvo-génitale ?	Une IVG est une Interruption Volontaire de Grossesse. Quand une personne est enceinte et ne souhaite pas poursuivre sa grossesse, elle peut y avoir recours à condition de respecter les délais. Les IVG sont autorisées jusqu'à 12 semaines de grossesse et sont confidentielles. Elles sont gratuites pour les mineures et prises en charge à 100% pour les majeures.	\N	\N	2021-06-29 15:42:40.177+02	\N	\N	2021-06-29 15:42:40.179+02	2021-06-29 15:42:40.193+02	\N	37
1496	Faire une fellation ou cunnilingus font partie des fantasmes fréquents ?	Faire une fellation ou un cunnilingus fait partie des fantasmes habituels et fréquents. D'autres fanstasmes fréquents incluent avoir des sentiments pour le ou la partenaire (eh ouais on vous voit les romantiques!), avoir des rapports dans un lieu qui sort de l'ordinaire, les fessées, les sextos, avoir des rapports sexuels avec plusieurs partenaires...	\N	\N	2021-06-29 15:42:40.37+02	\N	\N	2021-06-29 15:42:40.373+02	2021-06-29 15:42:40.389+02	\N	41
1497	Quand on a une IST, faut-il en parler à ses ancien•nes ou futur•es partenaires ?	Oui, en plus de symptômes qui peuvent désagréables, les IST peuvent entraîner des complications comme la stérilité, le cancer du col de l'utérus, etc. Elles ne se guérissent pas toutes seules et nécessitent un traitement. Il faut prévenir ses partenaires afin qu'ils·elles puissent se faire dépister, se soigner si besoin et ne pas contaminer d'autres personnes.	\N	\N	2021-06-29 15:42:40.546+02	\N	\N	2021-06-29 15:42:40.549+02	2021-06-29 15:42:40.563+02	\N	41
1498	Si on change de préservatif, on peut enchaîner pénétration anale, puis vaginale ou buccale ?	Oui, on peut avoir plusieurs pratiques sexuelles d'affilée si on en a envie, mais il faut toujours utiliser un préservatif et le changer pour chaque type de pénétration, même s'il n'y a pas eu d'éjaculation, même si c'est avec le·la même partenaire, même si on utilise un sextoy. Sinon, on risque une infection sexuellement transmissible ou des germes fécaux.	\N	\N	2021-06-29 15:42:40.924+02	\N	\N	2021-06-29 15:42:40.927+02	2021-06-29 15:42:40.948+02	\N	41
1499	Les hommes et les femmes ont le même nombre de partenaires au cours de leurs vies ?	Difficile d'avoir des chiffres exacts car tout le monde ne déclare pas tou·te·s ses partenaires... En fait, ce nombre n'a pas vraiment d'importance car la quantité de partenaires ne donne aucune indication sur la qualité du rapport ou de la relation. Avoir plein de partenaires ne veut pas nécessairement dire qu'on donne ou qu'on reçoit plus de plaisir !	\N	\N	2021-06-29 15:42:41.233+02	\N	\N	2021-06-29 15:42:41.235+02	2021-06-29 15:42:41.25+02	\N	39
1500	Il faut attendre d'être fou amoureux•ses pour faire sa première fois ?	Non ! L'amour et la sexualité ne sont pas toujours liés. On peut désirer une personne et avoir envie d'un rapport sexuel sans être amoureux·ses. On peut aussi aimer énormément quelqu'un mais ne pas avoir envie d'être intime avec lui·elle. L'essentiel pour sa première fois, et toutes les autres, c'est que les deux partenaires en aient envie.	\N	\N	2021-06-29 15:42:41.664+02	\N	\N	2021-06-29 15:42:41.666+02	2021-06-29 15:42:41.692+02	\N	39
1501	On peut fantasmer d'avoir des rapports gays ou lesbiens en étant hétéro ?	Oui, ça peut arriver, on peut avoir des fantasmes gays ou lesbiens, alors qu’on est hétéro, ou l'inverse. Quel que soit le fantasme, on n’a pas forcément envie que ça se réalise mais si on a envie de les réaliser et qu'on décide de les réaliser, attention à respecter la loi, le consentement, et à ne pas mettre en danger ses partenaires ou soi-même ;)	\N	\N	2021-06-29 15:42:42.243+02	\N	\N	2021-06-29 15:42:42.248+02	2021-06-29 15:42:42.263+02	\N	41
1502	Envoyer des dick pics ou autres photos de nu sans accord c'est ok ?	Non, ça peut être assimilé à de l'exhibitionnisme, passible d'un an de prison et 15 000€ d'amende. La loi prévoit une amende de 750€ pour qui a envoyé un message contraire à la décence sans accord préalable du destinataire. Une pratique répétée devient du harcèlement, passible de 2-3 ans ans de prison et de 30 000€ à 45 000€ d’amende selon l'âge de la victime.	\N	\N	2021-06-29 15:42:42.553+02	\N	\N	2021-06-29 15:42:42.555+02	2021-06-29 15:42:42.573+02	\N	37
1503	Dans le sadomasochisme, on peut continuer même si un•e des partenaires dit stop ?	Dans les pratiques sadomasochistes, presque tout est acceptable à partir du moment où on donne son accord. Mais, si l'un·e ou l'autre formule clairement son envie de stopper la pratique, il faut arrêter. Pour éviter toute incompréhension, on peut se mettre d'accord sur un nom de code pour arrêter, mais il faut tout de même rester attentif·ves à soi et aux partenaires.	\N	\N	2021-06-29 15:42:42.938+02	\N	\N	2021-06-29 15:42:42.941+02	2021-06-29 15:42:42.958+02	\N	41
1504	Si on reçoit régulièrement des messages "sexy" sans en avoir envie, c'est pas grave ?	Les messages à caractère sexuel, s'ils sont répétés et non souhaités par la personne qui les reçoit, peuvent correspondre à du harcèlement sexuel. La peine encourue est de 2 ans de prison. Avant d'envoyer ces messages, il faut s'assurer que la personne qui les reçoit est d'accord. Si on reçoit ce type de messages et qu'on en veut pas, on peut porter plainte.	\N	\N	2021-06-29 15:42:43.204+02	\N	\N	2021-06-29 15:42:43.208+02	2021-06-29 15:42:43.225+02	\N	37
1505	La contraception d'urgence est gratuite pour les mineures ?	Oui, si on a moins de 18 ans, la contraception d'urgence est gratuite et anonyme en centre de planification familiale, en pharmacie ou auprès de l'infirmier·ère scolaire. Si on a plus de 18 ans, elle peut être délivrée avec ou sans ordonnance (remboursée à 60% avec une ordonnance). Il faut compter entre 3€ et 7€.	\N	\N	2021-06-29 15:42:43.818+02	\N	\N	2021-06-29 15:42:43.819+02	2021-06-29 15:42:43.837+02	\N	37
1506	Les pertes blanches, c'est quoi ?	Le vagin est tapissé d'une muqueuse qui ressemble à celle de l'intérieur des joues. Comme toutes les muqueuses, la muqueuse vaginale produit un liquide en continu qui permet un auto-nettoyage constant et un maintien d'une flore équilibrée. Il peut se manifester par des pertes blanches : c'est une production naturelle du corps pour humidifier le vagin et préserver sa flore.	\N	\N	2021-06-29 15:42:44.086+02	\N	\N	2021-06-29 15:42:44.089+02	2021-06-29 15:42:44.115+02	\N	37
1507	À 14 ans, on peut avoir des relations sexuelles avec une personne de 13 ans ?	Deux mineur·es de moins de 15 ans peuvent librement avoir des rapports sexuels entre eux, à condition qu’ils·elles aient expressément consenti à le faire : ça veut dire qu'ils·elles doivent être d'accord, tou·te·s les deux, pour le faire. Pour être sûr·es, ne pas hésiter à communiquer avec son·sa partenaire dans un climat détendu, sans pression ni menaces.	\N	\N	2021-06-29 15:42:44.387+02	\N	\N	2021-06-29 15:42:44.389+02	2021-06-29 15:42:44.402+02	\N	39
1508	Pas de risque de grossesse non désirée pendant les règles ?	Il y a un risque de grossesse non désirée. Bien que les saignements ne soient pas favorables aux spermatozoïdes, l'ovulation peut se déclencher très tôt après les règles et les spermatozoïdes ont une durée de vie de quelques jours : donc, c'est possible d'être enceinte suite à des rapports pendant les règles (sauf si on a un moyen de contraception)	\N	\N	2021-06-29 15:42:44.643+02	\N	\N	2021-06-29 15:42:44.646+02	2021-06-29 15:42:44.668+02	\N	41
1509	L'érection du pénis et du clitoris c'est le même principe ?	Oui, le clitoris et le pénis sont des organes érectiles. Tous deux sont constitués des mêmes éléments. Lors de l'excitation, ils se gorgent de sang, gonflent et durcissent de la même manière : c'est ce qu'on appelle une érection.	\N	\N	2021-06-29 15:42:45.171+02	\N	\N	2021-06-29 15:42:45.173+02	2021-06-29 15:42:45.188+02	\N	37
1510	Les hommes peuvent avoir des cystites ?	Oui ! Les hommes peuvent avoir des cystites. Une cystite est une infection urinaire. Si quand on fait pipi, ça brûle ou ça pique, mieux vaut consulter un·e professionnel·le de santé immédiatement.	\N	\N	2021-06-29 15:42:45.456+02	\N	\N	2021-06-29 15:42:45.46+02	2021-06-29 15:42:45.483+02	\N	41
1511	En moyenne, un clitoris bande en 5 minutes ?	Non, un clitoris met une vingtaine de minutes à atteindre l'érection (ça peut varier selon la personne). Lors de l'excitation, le clitoris se gorge de sang, gonfle et durcit. La différence entre un clitoris au repos et en érection est flagrante ! Donc, à tou·te·s, prenez le temps de faire monter la chaleur pour que le clitoris puisse aller au bout de son érection !	\N	\N	2021-06-29 15:42:45.805+02	\N	\N	2021-06-29 15:42:45.807+02	2021-06-29 15:42:45.836+02	\N	41
1512	Les préservatifs internes ne se trouvent que sur internet ?	Non, ils peuvent s’acheter en pharmacie et sur internet, mais ils peuvent aussi se trouver gratuitement dans les Centres de Planification et d'Education Familiale (CPEF) et Centres Gratuits d'Information, de Dépistage et de Diagnostic (CeGIDD). Malheureusement ils sont plus durs à trouver et plus chers que les préservatifs externes/masculins.	\N	\N	2021-06-29 15:42:46.129+02	\N	\N	2021-06-29 15:42:46.132+02	2021-06-29 15:42:46.15+02	\N	41
1513	On peut guérir du VIH/SIDA ?	Non. Les traitements actuels ont pour but d’empêcher que l’infection du VIH évolue vers le SIDA et de renforcer le système immunitaire. Quand on est traité·e tôt, on ne transmet plus le VIH et on ne développe pas de maladie du SIDA. Il n’existe pas de vaccin contre le VIH/SIDA, d'où l'importance du dépistage pour connaître son statut, et si besoin, être traité·e.	\N	\N	2021-06-29 15:42:46.639+02	\N	\N	2021-06-29 15:42:46.641+02	2021-06-29 15:42:46.653+02	\N	39
1514	La vulve est composée de l'urètre, de l'hymen, des lèvres et de l'entrée du vagin ?	Non, il manque le clitoris ! C'est un organe dont seule l’extrémité, appelée le gland, est visible (en haut des petites lèvres). Les lèvres (petites + grandes) sont les muqueuses de la vulve. L'urètre est le petit trou par lequel sort le pipi. S'il y a un hymen, il est à l’entrée du vagin. La vulve, c'est l’ensemble de ces organes génitaux visibles.	\N	\N	2021-06-29 15:42:47.075+02	\N	\N	2021-06-29 15:42:47.079+02	2021-06-29 15:42:47.098+02	\N	37
1515	Le col de l'utérus se dilate lors d'une pénétration vaginale ?	Le col de l'utérus se situe au fond du vagin. Il se dilate :\r\n- lors des règles pour laisser passer le sang\r\n- lors d'une pénétration vaginale (en partie car ça facilite la remontée des spermatozoïdes)\r\n- lors de l'accouchement	\N	\N	2021-06-29 15:42:47.515+02	\N	\N	2021-06-29 15:42:47.518+02	2021-06-29 15:42:47.528+02	\N	41
1516	Quand on a eu des rapports sexuels, on doit le dire à nos parents ?	Non ! Rien n'oblige à en parler à ses parents. La sexualité relève de la sphère intime. C'est à chacun·e de décider de le dire ou non et à qui le dire.	\N	\N	2021-06-29 15:42:47.794+02	\N	\N	2021-06-29 15:42:47.796+02	2021-06-29 15:42:47.806+02	\N	39
1517	On peut expliquer pourquoi les mecs gays ne sont pas attirés sexuellement par les femmes ?	Non, on ne peut pas vraiment l'expliquer. À l'inverse, on ne peut pas vraiment expliquer pourquoi les hétérosexuel·les ne sont pas attiré·es sexuellement par les personnes de même sexe qu'eux·elles ou pourquoi les lesbiennes ne sont pas attirées sexuellement par les hommes. L'attirance sexuelle et l'orientation sexuelle sont propres à chacun·e.	\N	\N	2021-06-29 15:42:48.054+02	\N	\N	2021-06-29 15:42:48.058+02	2021-06-29 15:42:48.073+02	\N	37
1518	Les carrés de latex (ou digues buccales) permettent de se protéger des IST ?	Oui. Un carré de latex ou digue buccale (ou digue dentaire) est une membrane en latex (ou sans latex) qu'on place sur la vulve ou sur l'anus. On peut l'acheter en pharmacie ou le fabriquer avec un préservatif externe en coupant son bout fermé, puis en le coupant dans le sens de la hauteur. Il s'utilise lors des cunnilingus ou anulingus pour se protéger des IST.	\N	\N	2021-06-29 15:42:48.624+02	\N	\N	2021-06-29 15:42:48.629+02	2021-06-29 15:42:48.654+02	\N	39
1519	Les fantasmes, c'est toujours des scénarios qu'on veut vivre ?	Non, pas toujours. On s’imagine parfois des choses qu’on aurait honte de raconter ou qu'on ne veut pas vivre. Ça peut être perturbant, mais c'est normal ! C'est le cas par exemple des fantasmes de rapports forcés : <strong>ils ne veulent pas du tout dire que la personne veut vivre cela</strong>, ce n'est qu'un fantasme ! De plus, les agressions sexuelles et viols sont punis par la loi.	\N	\N	2021-06-29 15:42:49.099+02	\N	\N	2021-06-29 15:42:49.1+02	2021-06-29 15:42:49.113+02	\N	41
1520	Un gel siliconé lubrifie plus longtemps qu'un gel à l'eau ?	Oui, un gel siliconé, ou lubrifiant à base de silicone, n'est pas absorbé par les muqueuses et ne s'évapore pas. Ainsi, la lubrification dure en général plus longtemps. La lubrification additionnelle est importante quand on utilise un préservatif externe : elle diminue le risque de rupture du préservatif et peut améliorer les sensations !	\N	\N	2021-06-29 15:42:49.398+02	\N	\N	2021-06-29 15:42:49.4+02	2021-06-29 15:42:49.416+02	\N	41
1521	La rupture du frein est une petite déchirure qui peut saigner beaucoup ?	Oui, la rupture du frein peut causer des saignements importants. Ça arrive plutôt lors d’un 1er rapport. Une compression ferme de 10 mins permet l’arrêt du saignement. Il faut ensuite désinfecter (pas d’alcool, ça pique !). Le frein cicatrise seul mais on peut avoir des douleurs lors des rapports suivants : consulte un·e professionnel·le de santé si ça persiste.	\N	\N	2021-06-29 15:42:49.586+02	\N	\N	2021-06-29 15:42:49.588+02	2021-06-29 15:42:49.6+02	\N	39
1522	Si on veut prendre la pilule et qu'on fume, il faut le dire au•à la médecin ?	Oui, il faut le dire car les pilules combinées posent problème quand on fume. À tout âge, consommer du tabac ET prendre une pilule combinée augmente le risque thromboembolique et cardiovasculaire. Si on fume, il faut le dire à son·sa médecin qui proposera une contraception adaptée (pilule micro-progestative ou stérilet au cuivre ou hormonal par exemple).	\N	\N	2021-06-29 15:42:49.892+02	\N	\N	2021-06-29 15:42:49.896+02	2021-06-29 15:42:49.913+02	\N	39
1523	La pilule est le seul moyen de contraception existant ?	Non, il existe beaucoup de moyens de contraception différents ce qui permet à chacun·e de choisir sa solution la plus adaptée. Il y a par exemple les stérilets, les patch, l'implant, l'anneau vaginal ou les préservatifs. Les préservatifs permettent en plus de se protéger des IST : attention à bien les utiliser.	\N	\N	2021-06-29 15:42:50.199+02	\N	\N	2021-06-29 15:42:50.201+02	2021-06-29 15:42:50.212+02	\N	37
1524	Une couronne perlée sur le gland c'est quoi ?	C’est une particularité anatomique naturelle : des petites excroissances sur le gland. Avec le temps, leur taille diminue généralement, mais la couronne perlée ne disparaît pas totalement. Ce n’est pas une infection sexuellement transmissible (IST). Il ne faut pas la confondre avec les condylomes ou une mycose. En cas de doute, en parler à un·e médecin.	\N	\N	2021-06-29 15:42:50.389+02	\N	\N	2021-06-29 15:42:50.391+02	2021-06-29 15:42:50.404+02	\N	37
1525	Un•e majeur•e et un•e mineur•e de 16 ans ont le droit d'avoir des rapports sexuels ?	"Oui, une personne de plus de 18 ans et un·e mineur·e âgé·e de 15 à 18 ans ont le droit d'avoir des relations sexuelles, mais à condition : \r\n1) que tou·te·s les deux soient consentant·es à avoir ces relations sexuelles\r\n2) qu’il n’existe aucune autorité entre le·la majeur·e et le·la mineur·e (ça ne peut pas être le·la prof du·de la mineur·e, par exemple)."	\N	\N	2021-06-29 15:42:50.779+02	\N	\N	2021-06-29 15:42:50.781+02	2021-06-29 15:42:50.793+02	\N	39
1526	Avoir recours à la pilule d'urgence plus de 3 fois rend stérile ?	Non, prendre la contraception d'urgence n'a aucun impact sur ça. Ce n'est pas parce qu'on prend la contraception d'urgence plusieurs fois qu'on devient stérile. Par contre : \r\n1) elle peut avoir un impact ponctuel sur le cycle et décaler les règles, les retarder, les avancer\r\n2) ce n'est pas un moyen de contraception régulier comme le stérilet ou l'implant, par exemple.	\N	\N	2021-06-29 15:42:51.126+02	\N	\N	2021-06-29 15:42:51.131+02	2021-06-29 15:42:51.151+02	\N	41
1527	Le clitoris est un organe entièrement dédié au plaisir sexuel ?	Oui, c'est le seul organe 100% plaisir ! Quand il est excité, le clitoris durcit et entre en érection, sa taille varie alors selon les personnes : il peut être à peine visible ou grossir beaucoup. En le caressant, en le stimulant à l'extérieur ou dans sa partie interne, proche de la paroi vaginale, il peut déclencher beaucoup de plaisir ou un orgasme.	\N	\N	2021-06-29 15:42:51.46+02	\N	\N	2021-06-29 15:42:51.466+02	2021-06-29 15:42:51.485+02	\N	37
1528	Obtenir le consentement en menaçant, c’est comme si la personne n'avait pas consenti ?	Pour qu'il y ait consentement, il faut que la personne le donne librement, sans pression, menace, intimidation... La menace vient supprimer le consentement exprimé par la personne. Au moindre doute, il faut demander à son·sa partenaire, quel que soit le type de relation, quel que soit son genre, quelle que soit la situation.	\N	\N	2021-06-29 15:42:51.946+02	\N	\N	2021-06-29 15:42:51.948+02	2021-06-29 15:42:51.962+02	\N	41
1529	La loi autorise un•e majeur•e et un•e mineur•e de 14 ans à avoir des rapports sexuels ?	Non, la loi interdit les rapports sexuels entre un·e majeur·e (plus de 18 ans) et un·e mineur·e de moins de 15 ans, même si le·la mineur·e consent à la relation sexuelle. La relation sexuelle constitue une atteinte sexuelle sur mineur·e : c'est puni par la loi.	\N	\N	2021-06-29 15:42:52.608+02	\N	\N	2021-06-29 15:42:52.611+02	2021-06-29 15:42:52.629+02	\N	37
1530	Faire l'amour pendant les règles, c'est un manque d'hygiène ?	Non, il n'y a aucun problème d'hygiène concernant les rapports sexuels pendant les règles. Ce n'est pas sale. C'est un choix personnel à faire avec son·sa partenaire. Chez certaines personnes, il peut même y avoir une montée de la libido pendant les règles. Attention cependant à bien se protéger pour prévenir les IST et les grossesses non désirées.	\N	\N	2021-06-29 15:42:52.924+02	\N	\N	2021-06-29 15:42:52.926+02	2021-06-29 15:42:52.941+02	\N	39
1531	Le viol au sein d'un couple, ça existe ?	Oui, ça existe et c'est puni par la loi. Un couple est composé de deux partenaires avec des envies parfois différentes. Un couple n'est donc pas consentant par défaut : être en couple ne donne aucun droit sur l'autre, y compris dans les couples mariés.	\N	\N	2021-06-29 15:42:53.315+02	\N	\N	2021-06-29 15:42:53.317+02	2021-06-29 15:42:53.333+02	\N	39
1532	Dans le couple, pas besoin de s'assurer du consentement ?	Un couple est composé de deux partenaires avec des envies parfois différentes. Un couple n'est donc pas consentant par défaut : être en couple ne donne aucun droit sur l'autre, y compris dans les couples mariés. Le viol est puni par la loi.	\N	\N	2021-06-29 15:42:53.633+02	\N	\N	2021-06-29 15:42:53.635+02	2021-06-29 15:42:53.648+02	\N	37
1533	À quoi servent les règles ?	Les règles, c'est un phénomène naturel et cyclique de perte de sang qui dure en général entre 3 et 7 jours et apparaît chaque mois à partir de la puberté. À chaque cycle, l'utérus se prépare à accueillir un œuf fécondé : sa paroi s'épaissit. À la fin de chaque cycle, s'il n'y a pas de grossesse, cette partie épaissie est évacuée (il y a une perte de sang).	\N	\N	2021-06-29 15:42:53.89+02	\N	\N	2021-06-29 15:42:53.895+02	2021-06-29 15:42:53.921+02	\N	37
1534	La gonorrhée c'est quoi ?	La blennorragie gonococcique est une infection d’origine bactérienne. Elle provoque des brûlures ou un écoulement jaune par la verge, le vagin ou l'anus. Cette infection se transmet lors de rapports sexuels, bucco-génitaux (bouche-parties génitales), vaginaux ou anaux. Un traitement par antibiotiques permet une guérison rapide chez la personne et le·la·les partenaires.	\N	\N	2021-06-29 15:42:54.391+02	\N	\N	2021-06-29 15:42:54.396+02	2021-06-29 15:42:54.418+02	\N	41
1535	La syphillis c'est quoi ?	La syphilis est une infection bactérienne responsable de lésions de la peau et des muqueuses. Elle est sexuellement transmissible et favorise la transmission du VIH. Dépistée tôt, on peut la traiter efficacement par antibiotique chez la personne infectée et ses partenaires. Le port du préservatif (ou l'usage d'un carré de latex) permet de s'en protéger.	\N	\N	2021-06-29 15:42:54.683+02	\N	\N	2021-06-29 15:42:54.685+02	2021-06-29 15:42:54.698+02	\N	41
1536	Le préservatif interne est à placer dans le vagin ?	Le préservatif interne (aussi appelé "féminin") est une gaine en nitrile ou en polyuréthane munie d'un anneau souple aux deux extrémités. Il se place dans le vagin ou l'anus. Il peut être mis en place plusieurs heures avant le rapport sexuel ou juste avant. Il faut le changer à chaque rapport sexuel et entre chaque pénétration : on ne l'utilise qu'une seule fois !	\N	\N	2021-06-29 15:42:54.927+02	\N	\N	2021-06-29 15:42:54.93+02	2021-06-29 15:42:54.943+02	\N	39
1537	Les parents peuvent refuser que leur enfant soit homosexuel•le et le faire changer ?	Les parents n'ont pas le droit de refuser que leur enfant soit homosexuel.le. L'orientation sexuelle fait partie de la sphère privée et personne ne peut décider pour une autre personne (et c'est dans la loi ! ). Accepter son homosexualité peut être difficile. Pour en parler, on peut appeler le 0 810 20 30 40, 7j/7 de 8h à 23h (coût d'une communication locale).	\N	\N	2021-06-29 15:42:55.373+02	\N	\N	2021-06-29 15:42:55.375+02	2021-06-29 15:42:55.386+02	\N	37
1538	On peut choper une IST en faisant un cunni ?	Oui, les IST peuvent se transmettre lors d'un cunnilingus mais également lors d'une fellation ou d'un annulingus, lors de caresses, de frottements intimes, de contact entre muqueuses, y compris sans pénétration. Pour se protéger, on peut utiliser un carré de latex en le plaçant sur la vulve ou l'anus ou un préservatif lors d'une fellation ou lors d'une pénétration.	\N	\N	2021-06-29 15:42:55.954+02	\N	\N	2021-06-29 15:42:55.958+02	2021-06-29 15:42:55.978+02	\N	39
1539	Porter 2 préservatifs en même temps ça protège 2 fois plus ?	Non, il ne faut jamais utiliser deux préservatifs en même temps et ce, que ce soit deux préservatifs externes ("masculins") ou un préservatif externe et un préservatif interne ("féminin") en même temps. Ça risquerait de les fragiliser ou les déchirer et ainsi permettre la transmission d'infections sexuellement transmissibles ou une grossesse non désirée.	\N	\N	2021-06-29 15:42:56.372+02	\N	\N	2021-06-29 15:42:56.374+02	2021-06-29 15:42:56.387+02	\N	37
1540	Tous les pénis se ressemblent ?	Tous les pénis sont composés des mêmes éléments et organes mais ne se ressemblent pas tous. Ils sont tous différents en termes de forme, de diamètre ou de taille (on est loin de la représentation des films porno) : circoncis ou non, veineux ou pas, avec ou sans poils, épais, fin, long, moyen, court... il n'y a pas de pénis parfait ! Vive la diversité :)	\N	\N	2021-06-29 15:42:56.62+02	\N	\N	2021-06-29 15:42:56.624+02	2021-06-29 15:42:56.643+02	\N	37
1541	Certaines pilules d'urgence peuvent être prise 5 jours après un rapport non protégé ?	Oui, il y a une contraception d'urgence qui peut être prise jusqu'à 5 jours après un rapport non ou mal protégé. Il existe une autre pilule qui peut être prise jusqu'à 3 jours après. On peut la trouver en pharmacie, en centre de planification familiale, ou auprès de l'infirmière scolaire ou universitaire. Elle est gratuite et anonyme pour les mineur·es.	\N	\N	2021-06-29 15:42:56.899+02	\N	\N	2021-06-29 15:42:56.901+02	2021-06-29 15:42:56.914+02	\N	41
1542	La pilule peut faire prendre du poids ?	Oui, certaines pilules contraceptives peuvent parfois faire prendre du poids à la personne qui la prend. Ce n'est pas automatique, ce n'est pas toujours le cas. Si la pilule mentionne comme effet secondaire une possible prise de poids, il peut être recommandé d’être plus vigilante et d'en parler avec un·e professionnel·le de santé (médecin, sage-femme, gynéco...).	\N	\N	2021-06-29 15:42:57.18+02	\N	\N	2021-06-29 15:42:57.182+02	2021-06-29 15:42:57.195+02	\N	39
1543	La "pilule du lendemain" est une contraception d'urgence ?	Oui, mais ce n'est pas vraiment "du lendemain" car on peut la prendre jusqu'à 3-5 jours après un rapport sexuel non ou mal protégé (si le préservatif a craqué par exemple). ll faut la prendre le plus rapidement possible pour éviter toute grossesse non désirée c'est-à-dire pour éviter d'être enceinte. Elle ne protège pas des infections sexuellement transmissibles.	\N	\N	2021-06-29 15:42:57.429+02	\N	\N	2021-06-29 15:42:57.432+02	2021-06-29 15:42:57.443+02	\N	39
1544	L'os pénien (os du pénis) ça existe ?	L'os pénien est un os présent dans le pénis de certains mammifères comme l'ours ou le gorille mais pas chez l'humain. Un pénis humain est composé d'une tête, le gland, et d'un corps, la verge. La verge n'a pas d'os. Elle est constituée de tissus, de muscles, d’artères, de veines, de nerfs, et trois colonnes : les 2 corps "caverneux" et le corps "spongieux".	\N	\N	2021-06-29 15:42:57.639+02	\N	\N	2021-06-29 15:42:57.642+02	2021-06-29 15:42:57.666+02	\N	39
1545	Un préservatif peut glisser et resté coincé dans le vagin ou dans l'anus ?	Oui, en cas de préservatif pas déroulé jusqu'à la base, de préservatif trop grand, et/ou de retrait tardif (quand le pénis est déjà mou et plus petit), le préservatif peut glisser et rester à l'intérieur du vagin ou de l'anus. Pas de panique, on peut le retirer avec les doigts. En cas de risque (IST, grossesse non désirée), consulter un·e professionnel·le de santé.	\N	\N	2021-06-29 15:42:57.691+02	\N	\N	2021-06-29 15:42:57.696+02	2021-06-29 15:42:57.713+02	\N	41
1546	La libido c'est l'excitation sexuelle ?	Non, la libido c'est le désir sexuel. C'est le sentiment qui motive l'acte sexuel, c'est-à-dire qui donne envie d'avoir un acte sexuel avec soi (masturbation) ou avec un·e autre. Parfois, la libido n'est pas là alors qu'on aimerait qu'elle le soit. Si ça devient une gêne pour la vie sexuelle, on peut consulter un·e professionnel·le (psychologue, sexologue, médecin).	\N	\N	2021-06-29 15:42:57.959+02	\N	\N	2021-06-29 15:42:57.961+02	2021-06-29 15:42:57.975+02	\N	37
1547	Y a-t-il un risque de transmission d'IST dans un rapport lesbien ?	La majorité des IST se contracte par un échange de fluides entre partenaires. Les personnes ayant des rapports lesbiens peuvent transmettre ou contracter des IST à travers les échanges de mouille, via des frottements génitaux ou via des pénétrations avec des doigts ou objets non protégés et partagés. Le dépistage des IST est donc très important.	\N	\N	2021-06-29 15:42:58.434+02	\N	\N	2021-06-29 15:42:58.437+02	2021-06-29 15:42:58.453+02	\N	39
1548	L'homophobie désigne le rejet ou l'aversion envers les personnes LGBT+ ?	Oui, l’homophobie désigne toutes les manifestations de rejet (regard malveillant, mépris, insulte, coup, harcèlement, passage à tabac…) que peuvent subir des personnes LGBT+ (lesbiennes, gays, bisexuelles, transgenres), ou supposées l'être. Pour obtenir de l'aide en lien avec l'homophobie, tu peux contacter l'association SOS Homophobie, Ligne Azur ou un centre LGBT+.	\N	\N	2021-06-29 15:42:58.787+02	\N	\N	2021-06-29 15:42:58.79+02	2021-06-29 15:42:58.814+02	\N	45
1549	Victime d'agression, je ne sais pas qui est responsable, je peux porte plainte ?	Oui, tout à fait. Si tu ne sais pas qui a voulu te faire du mal, ou si tu n’es pas tout à fait certain·e de qui il s’agit, tu peux porter plainte contre X, c’est à dire contre une personne encore indéterminée. Essaie d'apporter aux policier·es / gendarmes un maximum d'informations concrètes (captures d'écran, photos, courriers, propos précis, témoignages, etc.).	\N	\N	2021-06-29 15:42:59.162+02	\N	\N	2021-06-29 15:42:59.165+02	2021-06-29 15:42:59.175+02	\N	37
1550	Mineur·e, on peut porter plainte pour actes homophobes sans l'accord des parents ?	Oui, si tu es victime d'agressions, injures ou harcèlement homophobes, tu peux porter plainte. Les policier·e·s / gendarmes n’ont pas le droit de demander l’accord de tes parents pour prendre ta plainte. Par contre, ils·elles ont le droit de les prévenir que tu es venu·e. Ils·Elles n’ont pas le droit de refuser de prendre ta plainte.	\N	\N	2021-06-29 15:42:59.488+02	\N	\N	2021-06-29 15:42:59.494+02	2021-06-29 15:42:59.522+02	\N	39
1551	Les personnes homosexuelles peuvent-elles donner leur sang ?	Suite aux risques de transmission du virus du VIH, les personnes homosexuelles ne pouvaient plus donner leur sang depuis 1983. La loi de 2016 rétablit cette injustice. Les personnes homosexuelles peuvent donner leur sang. Pour plus d'informations sur le don du sang, consulte  <a href="https://dondesang.efs.sante.fr/puis-je-donner">ce site</a>.	\N	\N	2021-06-29 15:42:59.832+02	\N	\N	2021-06-29 15:42:59.834+02	2021-06-29 15:42:59.846+02	\N	41
1552	En quelle année la France autorise-t-elle le mariage homosexuel ?	Le mariage pour les couples de personnes de même sexe (couples homosexuels) est autorisé en France par une loi datant de 2013. Cette loi ouvre également le droit à l'adoption. La France devient le neuvième pays de l'Union Européenne à autoriser le mariage homosexuel et le quatorzième pays dans le monde.	\N	\N	2021-06-29 15:43:00.101+02	\N	\N	2021-06-29 15:43:00.104+02	2021-06-29 15:43:00.127+02	\N	39
1553	L'homosexualité, c'est que chez l'être humain ?	Non. On compte pas moins de 1500 espèces animales (mammifères, oiseaux, reptiles et insectes) ayant des comportements homosexuels. Certaines espèces entretiennent même des relations de longue durée avec un partenaire de même sexe. L'homosexualité n'existe pas uniquement chez l'être humain.	\N	\N	2021-06-29 15:43:00.534+02	\N	\N	2021-06-29 15:43:00.536+02	2021-06-29 15:43:00.551+02	\N	41
1554	Être bisexuel·le c'est être polyamoureux·se ?	Non, ce n'est pas pareil. La bisexualité est l'attirance affective et/ou sexuelle pour des personnes des deux sexes / genres. C'est une orientation sexuelle. Le polyamour n'est pas une orientation sexuelle : on peut être polyamoureux·se qu’on soit homosexuel·le, hétérosexuel·le, bi·e, etc. Il s'agit d'être en relation affective / amoureuse avec plusieurs personnes en même temps.	\N	\N	2021-06-29 15:43:00.767+02	\N	\N	2021-06-29 15:43:00.771+02	2021-06-29 15:43:00.793+02	\N	37
1555	Les vergetures peuvent apparaître à la puberté ?	Oui, les vergetures peuvent apparaître quand le corps change. Par exemple, à la puberté, ou pendant la grossesse. On les trouve sur les fesses, le ventre, les seins, les épaules... Elles ont l'aspect de fissures ou de vagues. Elles deviennent plus claires avec le temps. Elles sont normales et fréquentes. Elles n'enlèvent rien à la beauté d'une personne :)	\N	\N	2021-06-29 15:43:01.323+02	\N	\N	2021-06-29 15:43:01.326+02	2021-06-29 15:43:01.341+02	\N	39
1556	Le cybersexisme, c'est puni par la loi ?	Oui. Ce terme désigne les comportements/propos sexistes sur la manière de s’habiller, le physique, le comportement amoureux/sexuel via des outils numériques. Les insultes, l'envoi répété de nudes sans accord ou le partage de photo intime d'une personne sans son consentement sont passibles de 2 à 3 ans de prison et de 30 000 à 60 000 euros d'amende.	\N	\N	2021-06-29 15:43:01.513+02	\N	\N	2021-06-29 15:43:01.515+02	2021-06-29 15:43:01.528+02	\N	41
1557	Les érections nocturnes, ça existe ?	Oui, les érections nocturnes ou matinales sont provoquées lors de la phase du sommeil paradoxal, sans explication exacte, en lien avec la phase des rêves. Avec en moyenne 3 à 6 phases de sommeil paradoxal, on peut avoir 3 à 6 érections par nuit d’une durée de 10 à 30 minutes chacune. Ce phénomène s'observe aussi bien sur le pénis comme sur le clitoris.	\N	\N	2021-06-29 15:43:01.691+02	\N	\N	2021-06-29 15:43:01.693+02	2021-06-29 15:43:01.705+02	\N	37
1558	Une IST est une Infection Sexuellement Transmissibles ?	Une IST signifie Infections Sexuellement Transmissibles. Elles peuvent se transmettent par la voie buccale, vaginale, anale et par frottements intimes. On retrouve la chlamydia, la blennorragie, la syphilis, les Hépatites, le papillomavirus, le VIH...Les préservatifs / carrés de latex font partie des moyens de protection associés à un dépistage régulier.	\N	\N	2021-06-29 15:43:01.977+02	\N	\N	2021-06-29 15:43:01.979+02	2021-06-29 15:43:01.991+02	\N	37
1559	La dysfonction érectile c'est quand on a une difficulté à :	C’est lorsque une personne ayant un pénis a des difficultés à obtenir / maintenir une érection suffisante pour permettre une relation sexuelle, depuis au moins 3 mois. La dysfonction est parfois minime, passagère (stress) ou plus importante, nécessitant une prise en charge (diabète, hypertension, tabagisme) par des traitements afin de régler / amélioration la situation.	\N	\N	2021-06-29 15:43:02.239+02	\N	\N	2021-06-29 15:43:02.242+02	2021-06-29 15:43:02.263+02	\N	37
