1561	La torsion testiculaire, c'est comme un torticolis des testicules ?	Non, c’est la torsion du cordon spermatique du testicule dans la bourse qui subit une rotation autour de sa base, provoquant ainsi une douleur brutale et intense qui irradie vers l'aine et l'abdomen pouvant entraîner un malaise, des nausées, des vomissements. La torsion touche essentiellement l'adolescent et l'homme jeune. Il s'agit d'une urgence chirurgicale absolue.	\N	\N	2021-06-29 15:43:02.656+02	\N	\N	2021-06-29 15:43:02.658+02	2021-06-29 15:43:02.672+02	\N	37
1562	On peut guérir de l'endométriose ?	Non, aujourd'hui, il n'existe pas de solutions définitives pour guérir de l’endométriose mais des traitements peuvent soulager la douleur et empêcher le développement des lésions. Ses symptômes sont le plus souvent des douleurs importantes.	\N	\N	2021-06-29 15:43:03.008+02	\N	\N	2021-06-29 15:43:03.01+02	2021-06-29 15:43:03.022+02	\N	37
