1564	La dyspareunie est une IST ?	Non. C'est lorsque l'on ressent une douleur locale ou diffuse lors d'un rapport sexuel. Les causes peuvent être physiques (allergies, infections, inflammations...) comme psychiques (stress, peur, manque d'excitation...). Si ça t'arrive, ou si ça persiste, n'hésite pas à consulter un.e professionel.le de santé pour établir un diagnostic et trouver un traitement adapté.	\N	\N	2021-06-29 15:43:03.378+02	\N	\N	2021-06-29 15:43:03.384+02	2021-06-29 15:43:03.408+02	\N	37
