1566	Le préservatif mis à l'envers peut être remis à l'endroit ?	Non, mettre le préservatif à l'envers puis le remettre à l'endroit peut présenter un risque, puisqu'il a pu être en contact avec des sécrétions sexuelles (généralement le liquide pré séminal) et donc transmettre une éventuelle IST. Si un préservatif a été mis à l'envers, il faut donc le jeter et en mettre un nouveau, cette fois-ci directement à l’endroit.	\N	\N	2021-06-29 15:43:03.952+02	\N	\N	2021-06-29 15:43:03.956+02	2021-06-29 15:43:03.982+02	\N	39
1567	L'endométriose est une maladie gynécologique fréquente ?	Oui, c'est une maladie gynécologique fréquente mais encore mal connue, liée à la présence de tissu semblable à la muqueuse utérine en dehors de l'utérus. Ces fragments de tissus qui ne sont pas à leur place peuvent être responsables de fortes douleurs lors des règles et des rapports sexuels, et peuvent être la cause d’une infertilité.	\N	\N	2021-06-29 15:43:04.322+02	\N	\N	2021-06-29 15:43:04.327+02	2021-06-29 15:43:04.347+02	\N	37
1568	Les morpions, c'est des poux ?	Le morpion ou pou du pubis est un parasite qui se nourrit de sang. Mesurant entre 2 à 3 mm, il pond des œufs qui se fixent à la base du poil pubien. Le plus souvent, la transmission se fait lors de rapports sexuels, via du linge ou d'une literie contaminée. Visible à l'œil nu, il provoque des démangeaisons et se traite par un antiparasitaire disponible en pharmacie.	\N	\N	2021-06-29 15:43:04.56+02	\N	\N	2021-06-29 15:43:04.564+02	2021-06-29 15:43:04.59+02	\N	37
