1570	Les personnes mineures peuvent demander l'IVG !	Toute personne enceinte, y compris mineure, qui ne veut pas poursuivre une grossesse peut demander l’IVG. Il est possible de se faire accompagner par ses parents ou une personne majeure de son choix. Prise en charge à 100%, et pouvant être anonyme pour les mineures, l'IVG se déroule par voie médicamenteuse ou instrumentale en fonction du délai de grossesse.	\N	\N	2021-06-29 15:43:05.091+02	\N	\N	2021-06-29 15:43:05.095+02	2021-06-29 15:43:05.123+02	\N	37
1571	Le polyamour, c'est être infidèle ?	C'est le fait d'être attiré.e par plusieurs personnes en même temps et d'avoir des relations avec elles et d'avoir un consentement éclairé entre toutes les personnes impliquées. Il ne s’agit pas d’une infidélité dans un couple monogame, mais d’une façon différente de concevoir ses relations amoureuses.	\N	\N	2021-06-29 15:43:05.431+02	\N	\N	2021-06-29 15:43:05.434+02	2021-06-29 15:43:05.449+02	\N	41
1572	Il est possible de se faire vacciner contre toutes les hépatites !?	Il existe 5 types de virus de l’hépatite, les plus connues sont la A, B et C. Provoquant une inflammation du foie, elles peuvent évoluer, en fonction du virus, vers la guérison ou progresser vers la fibrose, la cirrhose ou le cancer du foie. Il est possible d'être vacciné.e pour la A et B qui se transmettent sexuellement. La C se transmet par voie sexuelle ou sanguine.	\N	\N	2021-06-29 15:43:05.662+02	\N	\N	2021-06-29 15:43:05.666+02	2021-06-29 15:43:05.696+02	\N	37
1573	La douche vaginale est importante pour l'hygiène ?	Cette pratique consiste à se nettoyer l’intérieur du vagin avec un jet d’eau et du savon ; ce qui n’est pas recommandé. En effet, ça peut provoquer un déséquilibre de la flore vaginale et l’apparition d’irritations / mycoses. Un vagin n’est pas sale, il est auto-nettoyant et c'est normal d’avoir des petites odeurs à ce niveau.  En cas d’anomalie, consulte un.e médecin.	\N	\N	2021-06-29 15:43:05.987+02	\N	\N	2021-06-29 15:43:05.991+02	2021-06-29 15:43:06.017+02	\N	37
1574	Lubrifier, permet de faciliter une pénétration !?	La lubrification permet de faciliter une pénétration lors d'un rapport sexuel et celle-ci peut prendre plusieurs formes. Elle peut être anatomique comme la cyprine pour le vagin ou le liquide pré séminal pour le pénis. Elle peut aussi être artificielle comme le gel lubrifiant à base d'eau ou de silicone.	\N	\N	2021-06-29 15:43:06.224+02	\N	\N	2021-06-29 15:43:06.228+02	2021-06-29 15:43:06.249+02	\N	37
