1576	Je peux tomber enceint.e en avalant du sperme !?	Non, dans ce cas une grossesse est impossible. Lors d'une fellation avec éjaculation, le sperme arrivera dans l’estomac et il ne peut en aucun cas rejoindre l'appareil génital. Les risques liés à une fellation complète sont plus liés à des infections sexuellement transmissibles (IST) qu’à un risque de grossesse qui est inexistant.	\N	\N	2021-06-29 15:43:06.75+02	\N	\N	2021-06-29 15:43:06.755+02	2021-06-29 15:43:06.783+02	\N	41
1577	Le chemsex, c'est avoir un rapport sexuel en mangeant !	Faux. C’est l’usage de produits (drogues) en contexte sexuel, parfois par injection, pour un plaisir sexuel plus intense et prolongé. En lien avec des applications de rencontre les soirées peuvent réunir plusieurs personnes, parfois sur plusieurs jours. Cette pratique n’est pas nouvelle, elle n’est pas rattachée à une communauté sexuelle particulière.	\N	\N	2021-06-29 15:43:06.998+02	\N	\N	2021-06-29 15:43:07.003+02	2021-06-29 15:43:07.021+02	\N	41
