1579	Un.e médecin peut refuser une IVG ?	Oui, tout médecin a le droit de faire valoir sa clause de conscience et de refuser de pratiquer une IVG ; sans avoir à justifier son refus. Cependant, il / elle a pour obligation d'en informer immédiatement la personne et de l'orienter vers des praticien.nes qui pratiquent l'IVG.	\N	\N	2021-06-29 15:43:07.524+02	\N	\N	2021-06-29 15:43:07.529+02	2021-06-29 15:43:07.549+02	\N	37
1580	Le Sidaction récolte des dons pour financer la rechercher contre le VIH !	Sidaction désigne à la fois une association de lutte contre le VIH/sida et un évènement télévisuel annuel de collecte. L'objectif est de récolter des dons afin de faire avancer la recherche, d'améliorer la santé des personnes vivant avec le VIH, de financer des associations et de permettre un meilleur accès aux soins.	\N	\N	2021-06-29 15:43:07.71+02	\N	\N	2021-06-29 15:43:07.713+02	2021-06-29 15:43:07.724+02	\N	41
1581	Je peux me tester seul.e pour le VIH ?	Oui, avec un autotest. C’est un dispositif semblable à un test de grossesse, disponible gratuitement dans une association de prévention ou acheté en pharmacie. Réalisé par la personne elle-même, ce test permet, à partir d’une goutte de sang prélevée au bout du doigt, de dépister une infection du VIH datant de plus de 3 mois.	\N	\N	2021-06-29 15:43:07.913+02	\N	\N	2021-06-29 15:43:07.915+02	2021-06-29 15:43:07.929+02	\N	41
1582	Le stealthing, c'est quand la capote craque !	Faux. Le stealthing est une pratique qui consiste à retirer un préservatif sans avoir le consentement de son-sa partenaire ; pouvant entrainer une grossesse non désirée et / ou une IST comme le VIH. Dans certains pays, cette pratique est condamnée comme un viol.	\N	\N	2021-06-29 15:43:08.059+02	\N	\N	2021-06-29 15:43:08.061+02	2021-06-29 15:43:08.077+02	\N	41
1583	Faire pipi après une pénétration, permet d'éliminer les bactéries !	Les rapports sexuels peuvent favoriser les infections urinaires surtout s'ils sont fréquents ou s'il y a alternance entre l'anus et le vagin. Faire pipi après l'amour permet d'éliminer les bactéries pouvant remonter dans les voies urinaires. Pour limiter le risque d'infection, la capote peut se révéler utile tout en protégeant des IST et d'une grossesse non désirée.	\N	\N	2021-06-29 15:43:08.314+02	\N	\N	2021-06-29 15:43:08.317+02	2021-06-29 15:43:08.333+02	\N	37
