1705	La mouille, c'est quoi ?	La cyprine c'est l'autre nom de la mouille. Ce liquide transparent est le lubrifiant naturel du vagin. La mouille est souvent le signe de l'excitation sexuelle. Elle facilite la pénétration. Le stress, les médicaments, le manque d'excitation peuvent réduire la quantité de mouille. Si besoin, on peut alors ajouter du lubrifiant pour faciliter la pénétration.	\N	\N	2021-06-29 15:43:41.076+02	\N	\N	2021-06-29 15:43:41.079+02	2021-06-29 15:43:41.093+02	\N	38
1706	Le VIH/SIDA peut toucher n'importe qui ?	Oui, le VIH peut toucher n'importe qui. Il peut se transmettre : 1) lors d'un rapport sexuel non protégé avec une personne séropositive, 2) par transmission sanguine ou 3) lors de l'allaitement d'une femme séropositive à son enfant (plus rarement lors de la grossesse s'il n'y a pas de suivi ou de traitement).	\N	\N	2021-06-29 15:43:41.383+02	\N	\N	2021-06-29 15:43:41.385+02	2021-06-29 15:43:41.395+02	\N	38
1707	Si on ne veut pas avoir de rapports sexuels c'est parce qu'on est pas mûr ?	Non au contraire !  Connaître ses limites et les suivre, c'est un signe de maturité ;) ! Lors d'une relation sexuelle, tu vas donner à ton partenaire ce que tu as de plus intime, sans pouvoir le reprendre par la suite. C'est important d'être sûr de vouloir vraiment chaque rapport sexuel et d'être 100% consentant, sinon tu auras des regrets par la suite.	\N	\N	2021-06-29 15:43:41.65+02	\N	\N	2021-06-29 15:43:41.653+02	2021-06-29 15:43:41.668+02	\N	38
1708	L'érection du pénis et du clitoris c'est le même principe ?	Oui, le clitoris et le pénis sont des organes érectiles (= qui peuvent se durcir). Tous deux sont constitués des mêmes éléments. Lors de l'excitation, ils se remplissent de sang, gonflent et durcissent de la même manière : c'est ce qu'on appelle une érection.	\N	\N	2021-06-29 15:43:41.89+02	\N	\N	2021-06-29 15:43:41.894+02	2021-06-29 15:43:41.91+02	\N	38
1709	La puberté c'est le passage de l'enfance à l'adolescence ?	Oui, durant la puberté le corps de l'enfant se transforme progressivement en un corps d'adulte capable de se reproduire (= de faire des enfants). La puberté dure plusieurs années et s'accompagne de changements physiques (apparition de poils, des règles pour les filles, organes sexuels qui se développent...) et psychologiques.	\N	\N	2021-06-29 15:43:42.241+02	\N	\N	2021-06-29 15:43:42.244+02	2021-06-29 15:43:42.265+02	\N	38
1710	Avoir mal au ventre avant ou pendant ses règles, est ce normal ?	Oui, les règles peuvent s'accompagner de différentes douleurs  : crampes dans le bas ventre, tensions dans les seins, mal à la tête ou au dos….Les règles se manifestent différemment chez chaque femme. Une bouillote ou un bain chaud peuvent diminuer ces douleurs. Si les douleurs sont trop fortes, n’hésite pas à consulter ton infirmière scolaire ou ton médecin	\N	\N	2021-06-29 15:43:42.61+02	\N	\N	2021-06-29 15:43:42.612+02	2021-06-29 15:43:42.626+02	\N	38
1711	Une personne mineure peut être condamnée pour viol ?	Oui. Le viol est puni par la loi, y compris quand on est mineur. En cas de crime ou de délit, un adolescent doit rendre compte de ses actes devant la justice. Selon la gravité des faits le juge pourra prononcer une mesure éducative, une sanction éducative ou de la prison. Donc, si un mineur viole quelqu'un, il peut être condamné.	\N	\N	2021-06-29 15:43:42.858+02	\N	\N	2021-06-29 15:43:42.863+02	2021-06-29 15:43:42.891+02	\N	40
1712	Si on est mineure et qu'on veut avorter il faut l'accord des parents ?	Non. Il est recommandé d'en parler à ses parents, mais ce n'est pas une obligation. Les mineures doivent être accompagnées par une personne majeure qu'elles ont choisie.  On peut se rendre à la PMI, chez une infirmière, en parler à son infirmière scolaire, appeler le Réseau Périnat (06 94 99 18 36) ou le 0800 08 11 11 (numéro gratuit) pour recevoir de l'aide.	\N	\N	2021-06-29 15:43:43.132+02	\N	\N	2021-06-29 15:43:43.134+02	2021-06-29 15:43:43.146+02	\N	40
1713	Est-ce que la virginité est liée à l'hymen ?	Non. L'hymen est un petit bout de peau qui n'a pas de fonction particulière. Il n'est pas rare de naître sans hymen ou que ce dernier se soit déjà atrophié (déchiré) avant le premier rapport. Il est aussi possible que certaines femmes gardent leur hymen intact même après avoir accouché. Un hymen intact/déchiré/absent ne dit rien sur la virginité d'une personne.	\N	\N	2021-06-29 15:43:43.418+02	\N	\N	2021-06-29 15:43:43.423+02	2021-06-29 15:43:43.448+02	\N	40
1714	La pilule protège des IST ?	Non, la pilule contraceptive ne protège pas des infections sexuellement transmissibles (IST). C'est un moyen de contraception qui protège seulement du risque de grossesse. La pilule d'urgence ne protège pas non plus des IST. Le seul moyen de contraception qui protège aussi du VIH/SIDA et des autres IST, ce sont les préservatifs (masculin et féminin).	\N	\N	2021-06-29 15:43:43.684+02	\N	\N	2021-06-29 15:43:43.688+02	2021-06-29 15:43:43.713+02	\N	40
1715	Quand on a eu des rapports sexuels, on doit le dire à nos parents ?	Non ! Rien n'oblige à en parler à ses parents. La sexualité relève de la sphère intime. C'est à chacun de décider s'il veut en parler et avec qui.	\N	\N	2021-06-29 15:43:43.936+02	\N	\N	2021-06-29 15:43:43.938+02	2021-06-29 15:43:43.949+02	\N	40
1717	Il faut attendre d’être fou amoureux·se pour faire sa première fois ?	Non, amour et sexualité ne sont pas toujours liés même s'il est plus agréable de donner son corps à quelqu'un qu'on aime et qui nous aime. On peut désirer sexuellement une personne sans être amoureux. De même on peut aimer quelqu'un sans vouloir de sexe avec lui. L'essentiel pour sa première fois, et toutes les autres, c'est que les deux en aient envie.	\N	\N	2021-06-29 15:43:44.572+02	\N	\N	2021-06-29 15:43:44.576+02	2021-06-29 15:43:44.602+02	\N	40
1718	Le stérilet rend stérile ?	Non, contrairement à son nom le stérilet ne rend pas stérile. Dès qu'on le retire le cycle reproductif (ce qui permet de faire des enfants) de la femme recommence.	\N	\N	2021-06-29 15:43:44.807+02	\N	\N	2021-06-29 15:43:44.811+02	2021-06-29 15:43:44.834+02	\N	40
1719	Peut-on attraper le VIH en faisant une fellation ?	Oui, c'est possible même si le risque est plus faible que lors d'une pénétration vaginale. En revanche le risque d'attraper une autre IST lors d'une fellation est élevé qu'il y ait éjaculation ou non. C'est pourquoi il est recommandé d'utiliser un préservatif pour faire une fellation ou que les deux partenaires se fassent dépister avant.	\N	\N	2021-06-29 15:43:45.075+02	\N	\N	2021-06-29 15:43:45.077+02	2021-06-29 15:43:45.091+02	\N	40
1720	L'huile peut remplacer le lubrifiant ?	Non, huile et lubrifiant ce n'est pas pareil. L'huile ne peut pas remplacer le lubrifiant. Avec le préservatif, il est fortement recommandé d'utiliser du lubrifiant (gel à base d'eau ou de silicone). L'utilisation d'huile, de beurre, de crème peut irriter les parties génitales, fragiliser le préservatif... et donc le faire craquer, voire même le dissoudre.	\N	\N	2021-06-29 15:43:45.378+02	\N	\N	2021-06-29 15:43:45.38+02	2021-06-29 15:43:45.394+02	\N	42
1721	On peut coucher avec une personne très bourrée qui ne pas dit non ?	Non ! Une personne peut dire qu'elle est d'accord mais sans avoir vraiment conscience de ce qu'elle fait à cause des effets de l'alcool : on dit qu'elle n'est pas en capacité de donner son consentement. C'est pareil quand une personne est inconsciente. Dans ces cas-là, tout rapport sexuel devient un viol ou une agression sexuelle et est punie par la loi.	\N	\N	2021-06-29 15:43:45.658+02	\N	\N	2021-06-29 15:43:45.662+02	2021-06-29 15:43:45.679+02	\N	42
