1723	La contraception d'urgence est gratuite pour les mineures ?	Oui, si on a moins de 18 ans, la contraception d'urgence est gratuite et anonyme en centre de planification familiale, en pharmacie ou auprès de l'infirmière scolaire. Si on a plus de 18 ans, elle est gratuite à la PMI ou dans un CeGIDD. En pharmacie elle peut être délivrée sans ordonnance ou avec (remboursée à 60% dans ce cas). Elle coûte entre 3 et 7€.	\N	\N	2021-06-29 15:43:46.103+02	\N	\N	2021-06-29 15:43:46.105+02	2021-06-29 15:43:46.122+02	\N	40
