1728	Si on reçoit souvent des messages "sexy" sans en avoir envie, c'est grave ?	Oui c'est grave car les messages à caractère sexuel, répétés et non souhaités par la personne qui les reçoit, correspondent à du harcèlement sexuel. La peine encourue est de 2 ans de prison. Avant d'envoyer ces messages, il faut s'assurer que la personne qui les reçoit est d'accord. On peut porter plainte si on reçoit ce type de message non désirés.	\N	\N	2021-06-29 15:43:47.317+02	\N	\N	2021-06-29 15:43:47.321+02	2021-06-29 15:43:47.341+02	\N	38
1729	L'orgasme c'est quoi ?	C'est un plaisir sexuel intense entraînant une rapide perte des sens. Il peut s'accompagner de l'accélération de la respiration et du coeur et de contractions musculaires involontaires. C'est difficile de décrire un orgasme car les sensations ressenties varient d’un individu à l’autre, ou d’un moment à l’autre. On peut avoir un rapport sexuel sans avoir d'orgasme.	\N	\N	2021-06-29 15:43:47.622+02	\N	\N	2021-06-29 15:43:47.625+02	2021-06-29 15:43:47.641+02	\N	38
