1763	Un musée du phallus, ça existe ?	En Islande, il y a un musée national des phallus ! Dans d'autres pays, on trouve des musées érotiques ou des musées du sexe. Mais au fait, un phallus c'est quoi ? Le phallus, désigne le plus souvent le pénis en érection. C'est un terme hérité de l'Antiquité gréco-romaine.	\N	\N	2021-06-29 15:43:56.466+02	\N	\N	2021-06-29 15:43:56.468+02	2021-06-29 15:43:56.481+02	\N	42
1732	Pour les filles la puberté rime avec transformations ?	Oui, sous l'effet des hormones les seins, le clitoris et les lèvres de la vulve se développent, des poils apparaissent sous les bras et sur la vulve, des pertes blanches puis les premières règles surviennent. Le corps grandit rapidement et les hanches s'élargissent. Tous ces changements peuvent parfois être difficile à gérer mais pas de panique c'est normal.	\N	\N	2021-06-29 15:43:48.415+02	\N	\N	2021-06-29 15:43:48.418+02	2021-06-29 15:43:48.436+02	\N	38
