1734	Grossesse sans pénétration : c'est possible ?	Oui c'est possible, si du sperme est déposé à l'entrée du vagin, les spermatozoïdes peuvent remonter jusque dans l'utérus rendant ainsi une grossesse possible. Attention ! Les spermatozoïdes peuvent être présents également dans le liquide pré-séminal, qui est le liquide qui lubrifie le pénis avant l’éjaculation.	\N	\N	2021-06-29 15:43:48.919+02	\N	\N	2021-06-29 15:43:48.923+02	2021-06-29 15:43:48.943+02	\N	40
