1739	Si on a une IST on le sait forcément ?	Non, les personnes porteuses d'infections sexuellement transmissibles (IST) peuvent ne pas le savoir car il n'y a pas forcément de signes visibles (pas de douleurs, pas d'odeurs, pas de gênes etc.). Le dépistage permet de savoir si on est porteur d'une IST. Plus vite on prend le traitement, plus rapide sera la guérison.	\N	\N	2021-06-29 15:43:50.29+02	\N	\N	2021-06-29 15:43:50.294+02	2021-06-29 15:43:50.314+02	\N	40
1740	Il existe différents endroits où on peut faire un dépistage du VIH ?	Oui, tout à fait. A Saint-Laurent du Maroni, la Croix-Rouge, le CeGIDD du CHOG (ancien hôpital), et l'association Aides proposent un dépistage gratuit, anonyme et sans rendez-vous.  Votre médecin généraliste peut aussi vous faire une ordonnance pour vous rendre dans un laboratoire de biologie médicale.	\N	\N	2021-06-29 15:43:50.498+02	\N	\N	2021-06-29 15:43:50.502+02	2021-06-29 15:43:50.523+02	\N	40
1741	On peut guérir du VIH/SIDA ?	Non. On ne guérit pas du VIH mais on peut vivre avec en prenant un traitement. Ce traitement renforce le système immunitaire pour éviter que l’infection évolue vers le SIDA. Si on est traité tôt, on ne transmet plus le VIH et on n'atteint pas le stade SIDA. Il n’y a pas de vaccin contre le VIH. Le dépistage permet de savoir son statut, et si besoin, être traité.	\N	\N	2021-06-29 15:43:50.748+02	\N	\N	2021-06-29 15:43:50.75+02	2021-06-29 15:43:50.763+02	\N	40
1742	Un pénis peut saigner lors des premiers rapports sexuels ?	Oui ! Le pénis peut saigner lors des premiers rapports sexuels, cela arrive notamment s'il n'y a pas assez de lubrifiant, si le frein est un peu court ou si le prépuce est trop étroit pour être décalotté facilement, mais tout rentre dans l'ordre assez facilement. En cas de douleurs ou de saignements, pas de panique, on peut consulter un profesionnel de santé.	\N	\N	2021-06-29 15:43:51.015+02	\N	\N	2021-06-29 15:43:51.018+02	2021-06-29 15:43:51.034+02	\N	40
1743	Être homo et être trans c'est pareil ?	Non, un transgenre est une personne dont les organes génitaux ne correspondent pas à son identité de genre (la manière dont cette personne se sent et se définit). Exemple : quelqu’un qui a un pénis mais qui se sent et se définit comme une femme. Un homosexuel est une personne attirée sexuellement ou sentimentalement par une personne du même sexe que le sien.	\N	\N	2021-06-29 15:43:51.257+02	\N	\N	2021-06-29 15:43:51.259+02	2021-06-29 15:43:51.272+02	\N	42
1744	L'herpès génital touche combien de personnes en France ?	Environ 2 millions de personnes sont touchées par l'herpès génital en France. Cette IST peut rester endormie pendant des années et apparaître plus tard. Ce virus est très contagieux pendant les poussées qui se manifestent par des picotements, des boutons, des brûlures, des blessures près des organes génitaux. Un traitement existe pour empêcher les poussées.	\N	\N	2021-06-29 15:43:51.503+02	\N	\N	2021-06-29 15:43:51.505+02	2021-06-29 15:43:51.517+02	\N	42
1745	Si les petites lèvres sont plus longues que les grandes, c'est normal ?	C'est normal ! Selon les vulves, les petites/grandes lèvres sont + ou - grandes, peuvent être asymétriques et de couleurs assez variées, du rose clair au marron + ou - foncé. Toutes les vulves sont belles, chacune à sa façon ! Si on a une vulve, ne pas hésiter à prendre un miroir pour la regarder et se familiariser avec : c'est important de se connaître !	\N	\N	2021-06-29 15:43:51.741+02	\N	\N	2021-06-29 15:43:51.744+02	2021-06-29 15:43:51.766+02	\N	42
1746	On peut utiliser un préservatif féminin et masculin en même temps ?	Non, il ne faut jamais utiliser un préservatif externe ("masculin") et un préservatif interne ("féminin") en même temps : ça risquerait de les déchirer, et peut-être alors de provoquer une grossesse non désirée ou permettre la transmission d'infections sexuellement transmissibles (IST).	\N	\N	2021-06-29 15:43:51.986+02	\N	\N	2021-06-29 15:43:51.988+02	2021-06-29 15:43:52+02	\N	42
1747	Est-il dangereux d'avaler du sperme ?	Non, le sperme en soi n'est pas dangereux pour la santé, il s'agit majoritairement d'eau, de spermatozoides et de nutriments. Son goût dépendra de ce que le garçon a mangé. Attention cependant le sperme peut transmettre des Infections Sexuellement Transmissibles dont le VIH. Il faut donc se faire dépister de toutes les IST avant d'avaler du sperme.	\N	\N	2021-06-29 15:43:52.174+02	\N	\N	2021-06-29 15:43:52.176+02	2021-06-29 15:43:52.189+02	\N	42
1748	Une personne qui force sa partenaire enceinte à avorter, c'est illégal ?	Oui, il est interdit de forcer une femme, mineure ou majeure, à avorter. La décision finale n'appartient qu'à la femme enceinte. Le partenaire est là pour conseiller mais ne peut pas faire pression. Pratiquer une interruption de grossesse sans le consentement de la femme enceinte peut être puni de cinq ans d'emprisonnement et de 75 000 euros d'amende.	\N	\N	2021-06-29 15:43:52.406+02	\N	\N	2021-06-29 15:43:52.408+02	2021-06-29 15:43:52.42+02	\N	42
1749	La flore du vagin est fragile et doit être protégée ?	Oui, la flore du vagin est fragile, il faut donc éviter tout ce qui pourrait modifier son PH car les variations du pH vaginal peuvent entraîner un déséquilibre et des infections telles que des mycoses. Plein de facteurs peuvent l’influencer : antibiotiques, toilette inadaptée (douches vaginales), règles, sperme (le pH vaginal augmente un temps avec le sperme).	\N	\N	2021-06-29 15:43:52.659+02	\N	\N	2021-06-29 15:43:52.662+02	2021-06-29 15:43:52.676+02	\N	42
1750	Les bouglous ou les dominos est-ce dangereux ?	Oui, la pose des dominos se fait souvent dans de mauvaises conditions sanitaires (avec une lame de rasoir ou un couvercle de boîte de sardine) qui entrainent dans la majorité des cas des inflammations ou des infections. Les porteurs de bouglous sont aussi plus susceptibles d'attraper une IST ou de développer un cancer.	\N	\N	2021-06-29 15:43:52.89+02	\N	\N	2021-06-29 15:43:52.893+02	2021-06-29 15:43:52.914+02	\N	42
1751	La PreP permet d'éviter d'avoir le VIH ?	Oui, la PrEP est un traitement qui permet d'éviter une éventuelle contamination au VIH. Elle ne protège pas des autres IST (hépatites, syphillis, etc.) et ne protège que celui qui la prend. Elle est prise en charge à 100% et s'obtient auprès d'un médecin en CeGIDD ou à l'hôpital avec un infectiologue, et nécessite un suivi dépistage tous les 3 mois.	\N	\N	2021-06-29 15:43:53.158+02	\N	\N	2021-06-29 15:43:53.16+02	2021-06-29 15:43:53.173+02	\N	42
1752	Il faut consulter un médecin si on a une testicule plus haute que l'autre ?	Non, c'est tout à fait normal pour un garçon d'avoir une testicule (aussi appelée bourse) plus haute que l'autre.	\N	\N	2021-06-29 15:43:53.403+02	\N	\N	2021-06-29 15:43:53.407+02	2021-06-29 15:43:53.424+02	\N	38
1753	Y a-t-il un risque d'IST dans un rapport lesbien ?	Oui, la majorité des IST s'attrape par un échange de liquides entre partenaires. Les filles ayant des rapports lesbiens peuvent transmettre ou attraper des IST via les échanges de mouille : par exemple lors d'un cunnilingus, de frottements génitaux ou d’une pénétration avec un gode non protégé et partagé. Le dépistage des IST est donc très important.	\N	\N	2021-06-29 15:43:53.683+02	\N	\N	2021-06-29 15:43:53.687+02	2021-06-29 15:43:53.707+02	\N	40
1754	Plus un homme est petit, plus son pénis est petit ?	Légende urbaine ! La taille d'une personne ne donne aucune idée de la taille de son sexe. La seule façon de connaître la longueur d'un pénis c'est de mesurer le pénis en érection entre le bas du ventre et le bout du gland. Et d'ailleurs, pas besoin d'en faire une obsession, pour donner et recevoir du plaisir, ce n'est pas la taille du pénis qui compte.	\N	\N	2021-06-29 15:43:53.95+02	\N	\N	2021-06-29 15:43:53.953+02	2021-06-29 15:43:53.966+02	\N	38
1755	Jamais envie de rapports sexuels... c'est possible ?	Oui. Certaines personnes n'ont juste pas envie et c'est tout à fait possible et normal (on appelle ça l'asexualité). Il peut aussi s'agir d'autres raisons : pas le bon moment, pas la bonne personne, après une expérience traumatisante, manque de libido, le stress, etc. : si tu en ressens le besoin, tu peux consulter un professionnel de santé.	\N	\N	2021-06-29 15:43:54.263+02	\N	\N	2021-06-29 15:43:54.266+02	2021-06-29 15:43:54.286+02	\N	40
1756	Consentir sous la menace, c’est comme si la personne n'avait pas consenti ?	Oui car pour qu'il y ait consentement, il faut que la personne le donne librement, sans pression, menace, chantage... La menace vient supprimer le consentement exprimé par la personne. Si la personne est menacée, il n'y a pas de consentement possible... La relation devient un viol ou une agression sexuelle et c'est puni par la loi.	\N	\N	2021-06-29 15:43:54.518+02	\N	\N	2021-06-29 15:43:54.521+02	2021-06-29 15:43:54.535+02	\N	42
1757	Être vierge protège-t-il du VIH ?	Non, le VIH/Sida ne se transmet pas exclusivement lors de rapports sexuels. Il existe d’autres modes : de la mère à l’enfant, le partage de seringue ou aiguille ou encore les échange de fluide. Faire le test de dépistage est le seul moyen de savoir si on est positif ou non.	\N	\N	2021-06-29 15:43:54.829+02	\N	\N	2021-06-29 15:43:54.832+02	2021-06-29 15:43:54.85+02	\N	40
1758	Si on est proche de l'orgasme, on continue même si le/la partenaire n'a plus envie ?	Non, le consentement peut à tout moment être retiré. Si le ou la partenaire n'a plus envie, c'est un viol de continuer le rapport sexuel. Quand un des deux partenaires  veut arrêter, quel que soit le moment ou la raison, il faut arrêter. En cas de violences sexuelles, on peut appeler le 3919 pour recevoir de l'aide.	\N	\N	2021-06-29 15:43:55.095+02	\N	\N	2021-06-29 15:43:55.099+02	2021-06-29 15:43:55.121+02	\N	42
1759	Un orgasme pendant un rapport non consenti, c’est la preuve du consentement ?	Non, l’orgasme peut être un moyen de défense adopté par le corps lors du rapport sexuel non consenti. Cela reste un viol car il n’y a pas eu de consentement à l’acte, même s'il y a orgasme, même s'il y a mouille ou même s'il y a érection, par exemple. En cas de violences sexuelle, on peut appeler le 3919 pour recevoir conseils, aide et info.	\N	\N	2021-06-29 15:43:55.352+02	\N	\N	2021-06-29 15:43:55.355+02	2021-06-29 15:43:55.375+02	\N	42
1760	La loi autorise l'homme à forcer sa femme à avorter ?	Il est interdit de forcer une femme, mineure ou majeure, à avorter. L'homme ne peut pas forcer la femme à avorter quelle que soit la situation (couple marié ou non, relation d'un soir, etc). La décision finale n'appartient qu'à la femme enceinte. Pratiquer un avortement sans le consentement de la femme enceinte est puni par la loi.	\N	\N	2021-06-29 15:43:55.636+02	\N	\N	2021-06-29 15:43:55.639+02	2021-06-29 15:43:55.658+02	\N	38
1761	Une couronne perlée sur le gland c'est quoi ?	Oui, c’est une particularité anatomique naturelle : des petits boutons sur la base du gland. Avec le temps, leur taille diminue généralement, mais la couronne perlée ne disparaît pas totalement. Ce n’est pas une infection sexuellement transmissible (IST). Il ne faut pas la confondre avec les condylomes ou une mycose. En cas de doute, en parler à un médecin.	\N	\N	2021-06-29 15:43:55.896+02	\N	\N	2021-06-29 15:43:55.9+02	2021-06-29 15:43:55.92+02	\N	38
1762	Le vaginisme c'est... ?	Aucun des deux. Le vaginisme désigne une contraction involontaire des muscles qui entourent le vagin. Cette contraction involontaire rend toute pénétration du vagin par un doigt, un pénis ou un sex-toy impossible. Si on force, on peut ressentir de vives douleurs. On peut en parler, si on veut, à un professionnel de santé car des solutions existent	\N	\N	2021-06-29 15:43:56.168+02	\N	\N	2021-06-29 15:43:56.171+02	2021-06-29 15:43:56.182+02	\N	42
1764	Les femmes préfèrent-elles les hommes avec des bouglous ?	<strong>Ca dépend des femmes !</strong> Si certaines femmes peuvent apprécier ces petites billes glissées sous la peau du pénis, la majorité d'entre elles témoignent plutôt d'inconfort voire de douleurs. Il est recommandé, avant de s'en faire poser un, d’en discuter avec sa partenaire et d’essayer les préservatifs texturés (qui ont des petits picots comme les bouglous).	\N	\N	2021-06-29 15:43:56.671+02	\N	\N	2021-06-29 15:43:56.673+02	2021-06-29 15:43:56.684+02	\N	42
1765	5 ans après un viol, la victime peut encore porter plainte ?	Oui, la victime de viol peut porter plainte jusqu’à 20 ans après le viol. Si au moment du viol, la personne est mineure, le délai de 20 ans commence à partir de son 18ème anniversaire.<strong>Le viol est un crime puni par la loi</strong>. Il est passible de 15 ans de prison.	\N	\N	2021-06-29 15:43:56.914+02	\N	\N	2021-06-29 15:43:56.917+02	2021-06-29 15:43:56.935+02	\N	42
1766	Les pertes blanches peuvent changer de consistance en fonction du cycle ?	Oui, les pertes blanches peuvent varier d'aspect et de consistance selon les moments du cycle. Elles sont + ou - importantes selon les personnes et les moments de la vie. Il est important d'écouter et d'observer son corps pour identifier quand elles sont signes de bonne santé ou quand elles indiquent une infection (mauvaise odeur, démangeaisons...).	\N	\N	2021-06-29 15:43:57.126+02	\N	\N	2021-06-29 15:43:57.129+02	2021-06-29 15:43:57.144+02	\N	38
1767	Ajouter du lubrifiant sur un préservatif externe, c'est bien ?	Oui. un vagin, ça ne mouille pas en continu pendant un rapport, et un anus ça ne mouille que très peu et très lentement, voire pas du tout. Le lubrifiant permet une lubrification additionnelle. Il est à mettre sur le préservatif externe ou à l'entrée du vagin ou de l'anus : ça permet de diminuer les risques de rupture du préservatif et d'augmenter les sensations !	\N	\N	2021-06-29 15:43:57.438+02	\N	\N	2021-06-29 15:43:57.44+02	2021-06-29 15:43:57.454+02	\N	38
1768	Il n’y a que les êtres humains qui peuvent être homosexuels ?	Non. On compte environ 1 500 espèces animales (mammifères, oiseaux, reptiles et insectes) ayant des comportements homosexuels. Certaines espèces entretiennent même des relations de longue durée avec un partenaire de même sexe. L'homosexualité n'existe pas uniquement chez l'être humain.	\N	\N	2021-06-29 15:43:57.67+02	\N	\N	2021-06-29 15:43:57.672+02	2021-06-29 15:43:57.684+02	\N	38
1769	La rupture du frein est une petite déchirure qui peut saigner beaucoup ?	Oui, la rupture du frein (ce bout de peau qui relie le gland et le prépuce) peut causer des saignements importants. Une compression ferme de 10 min permet l’arrêt du saignement. Il faut ensuite désinfecter (pas d’alcool, ça pique !). Ce n'est pas grave mais il vaut mieux consulter rapidement son médecin généraliste ou un professionnel de santé.	\N	\N	2021-06-29 15:43:57.854+02	\N	\N	2021-06-29 15:43:57.856+02	2021-06-29 15:43:57.867+02	\N	40
1770	Si on change de préservatif, on peut enchaîner pénétration anale vaginale  ?	Oui, on peut avoir plusieurs pratiques sexuelles d'affilée si on en a envie, mais il faut toujours utiliser un préservatif et le changer pour chaque type de pénétration, même s'il n'y a pas eu d'éjaculation, même si c'est avec le ou la même partenaire, et même si on utilise un sextoy. Sinon, on risque une IST ou des germes fécaux.	\N	\N	2021-06-29 15:43:58.169+02	\N	\N	2021-06-29 15:43:58.172+02	2021-06-29 15:43:58.198+02	\N	42
1771	La durée moyenne d'une pénétration vaginale est de ?	La pénétration vaginale dure en moyenne 5 à 7 minutes. Cette durée dépend de nombreux facteurs : état d'excitation, date de la dernière éjaculation, rythme des mouvements, fatigue, etc. Donc pas de panique si c’est plus court. De plus le sexe ne se limite pas à la pénétration, avec des caresses et des câlins avant et après, c’est encore plus sympa ;)	\N	\N	2021-06-29 15:43:58.579+02	\N	\N	2021-06-29 15:43:58.582+02	2021-06-29 15:43:58.597+02	\N	40
1772	À 14 ans, on peut avoir une relation sexuelle avec une personne de 13 ans ?	Oui, deux jeunes mineurs de moins de 15 ans peuvent librement avoir des rapports sexuels entre eux, à condition qu’ils soient tous les deux d'accord. Pour savoir si l'autre est d'accord, il faut lui poser la question dans un climat détendu, sans pression, sans violence, ni chantage, ni menace.	\N	\N	2021-06-29 15:43:58.856+02	\N	\N	2021-06-29 15:43:58.859+02	2021-06-29 15:43:58.876+02	\N	40
1773	Quand le partenaire est trop excité, il faut aller jusqu'au bout ?	Non. On peut toujours arrêter un rapport sexuel, que que soit le moment, sans avoir besoin de se justifier auprès de son partenaire. Arrêter un rapport qui a commencé peut générer de la frustration qu'il faut apprendre à gérer : le plus important est de respecter la volonté du partenaire. Refuser de s'arrêter quand le partenaire le demande est un viol.	\N	\N	2021-06-29 15:43:59.143+02	\N	\N	2021-06-29 15:43:59.145+02	2021-06-29 15:43:59.159+02	\N	42
1774	Il faut obligatoirement une ordonnance pour le dépistage du VIH ?	Non. Le dépistage du VIH peut être fait sans ordonnance. Il est gratuit dans les CeGIDD, dans certains centres de planification familiale ou via certaines associations (Aides). On peut aussi en faire sans ordonnance et en payant les frais dans un laboratoire de biologie médicale, ou soi-même en achetant un auto-test en pharmacie.	\N	\N	2021-06-29 15:43:59.38+02	\N	\N	2021-06-29 15:43:59.382+02	2021-06-29 15:43:59.398+02	\N	42
1775	La loi autorise un majeur et une mineure de 14 ans à avoir des rapports sexuels ?	Non, la loi interdit les rapports sexuels entre une personne majeure (plus de 18 ans) et un mineur de moins de 15 ans, même si la personne mineure est d'accord pour la relation sexuelle. La relation sexuelle constitue une atteinte sexuelle sur mineur : <strong>c'est puni par la loi</strong>.	\N	\N	2021-06-29 15:43:59.534+02	\N	\N	2021-06-29 15:43:59.536+02	2021-06-29 15:43:59.55+02	\N	38
1776	Être pansexuel c'est quoi ?	Aucun des deux, être pansexuel désigne le fait d'être attiré, sexuellement ou sentimentalement, par les personnes indifféremment de leur sexe, de leur genre ou de leur orientation sexuelle. Les personnes bisexuelles s'intéressent à la fois aux hommes et aux femmes. Les personnes pansexuelles sont attirées par les hommes, les femmes, les transgenres, etc.	\N	\N	2021-06-29 15:43:59.813+02	\N	\N	2021-06-29 15:43:59.815+02	2021-06-29 15:43:59.829+02	\N	42
1777	Les hommes peuvent aussi avoir des infections urinaires ?	Oui ! Les hommes peuvent aussi avoir une infection urinaire (ou cystite).  Elle se manifeste par une brûlure ou des picotements quand on urine et par des envies d'uriner très rapprochées. Mieux vaut consulter un professionnel de santé immédiatement car un traitement rapide et efficace existe.	\N	\N	2021-06-29 15:44:00.057+02	\N	\N	2021-06-29 15:44:00.058+02	2021-06-29 15:44:00.071+02	\N	42
1778	La gonorrhée c'est quoi ?	Une IST. La gonorrhée ou chaude-pisse est une infection d’origine bactérienne transmise lors de rapports sexuels non protégés. Elle se manifeste par des brûlures et/ou par un liquide jaune qui s'écoule du pénis, du vagin ou de l'anus. Un traitement par antibiotiques permet une guérison rapide des deux partenaires. Non traitée, cette IST peut rendre stérile.	\N	\N	2021-06-29 15:44:00.212+02	\N	\N	2021-06-29 15:44:00.216+02	2021-06-29 15:44:00.244+02	\N	42
1779	En moyenne, un clitoris bande en 5 minutes ?	Non, un clitoris met environ une vingtaine de minutes à atteindre l'érection (ça peut varier selon la personne). Lors de l'excitation, le clitoris se gorge de sang, gonfle et durcit. Donc, prenez le temps de le cajoler et de le chouchouter pour découvrir ainsi les merveilles du clitoris.	\N	\N	2021-06-29 15:44:00.431+02	\N	\N	2021-06-29 15:44:00.434+02	2021-06-29 15:44:00.447+02	\N	38
1780	Y a-t-il un risque de transmission d'IST dans un rapport lesbien ?	La majorité des IST se contracte par un échange de liquides entre partenaires. Les filles ayant des rapports lesbiens peuvent transmettre ou contracter des IST à travers les échanges de mouille, via des frottements génitaux ou via des pénétrations avec des doigts ou objets non protégés et partagés. Le dépistage des IST est donc très important.	\N	\N	2021-06-29 15:44:00.654+02	\N	\N	2021-06-29 15:44:00.656+02	2021-06-29 15:44:00.669+02	\N	42
1781	Le retrait est une méthode de contraception fiable ?	Non ce n'est pas efficace, car le liquide pré-séminal qui sert à lubrifier la verge peut contenir des spermatozoïdes, il y a donc un risque de grossesse avec cette technique. De plus, il peut y avoir des "ratés" (éjaculation précoce, retrait tardif ou impossible dans le feu de l'action). En l’absence contraceptif, le retrait est cependant mieux que rien.	\N	\N	2021-06-29 15:44:00.909+02	\N	\N	2021-06-29 15:44:00.911+02	2021-06-29 15:44:00.926+02	\N	38
1782	Le liquide pré-séminal peut -il provoquer une grossesse non désirée ?	A l’état naturel, le liquide pré-séminal ne contient pas de spermatozoïdes. MAIS, il peut entraîner avec lui des spermatozoïdes qui sont déjà présents dans l’urètre suite à une précédente éjaculation. De ce fait, une pénétration, même sans éjaculation peut parfois entraîner une grossesse.	\N	\N	2021-06-29 15:44:01.098+02	\N	\N	2021-06-29 15:44:01.1+02	2021-06-29 15:44:01.115+02	\N	40
1783	Un vagin peut être trop petit ?	Un vagin ne peut pas être trop petit. C'est un muscle extensible : sa dimension varie lors d'un rapport ou lors de l'accouchement par exemple. S'il y a des douleurs ou si la pénétration est impossible c'est souvent lié à la contraction des muscles du vagin ou au manque de lubrification (de mouille). Consulter un professionnel de santé si ça persiste.	\N	\N	2021-06-29 15:44:01.315+02	\N	\N	2021-06-29 15:44:01.317+02	2021-06-29 15:44:01.331+02	\N	40
1784	Les garçons disent toujours "oui", ils ont toujours envie de sexe ?	Non, les garçons n'ont pas toujours envie et n'ont pas plus de besoins sexuels que les femmes. En face, la partenaire doit en tenir compte. Les hommes aussi peuvent refuser, douter, hésiter, être contraints, faire l'objet de chantage... et dans ce cas, il n'y a pas de consentement. Un rapport sexuel sans consentement est un viol, et c'est puni par la loi.	\N	\N	2021-06-29 15:44:01.53+02	\N	\N	2021-06-29 15:44:01.534+02	2021-06-29 15:44:01.557+02	\N	40
1785	On peut attraper une IST sans pénétration ?	Oui ! Les Infections Sexuellement Transmissibles peuvent se transmettre lors d'une fellation ou d'un cunnilingus : si les deux partenaires ne se sont pas fait tester, il vaut mieux utiliser un préservatif lors d’une fellation et un carré de latex lors du cunni. Une bonne hygiène du corps est aussi recommandée (mais ce n’est pas suffisant pour éviter une IST).	\N	\N	2021-06-29 15:44:01.742+02	\N	\N	2021-06-29 15:44:01.744+02	2021-06-29 15:44:01.761+02	\N	40
1786	Quand on a une IST, faut-il en parler à ses anciens ou actuels partenaires ?	Oui, en plus de symptômes qui sont désagréables, les IST peuvent entraîner des complications comme la stérilité ou le cancer du col de l'utérus. Elles ne guérissent pas toutes seules et nécessitent un traitement. Il faut donc prévenir ses partenaires pour qu’ils se fassent dépistés et soignés si besoin pour ne pas contaminer d'autres personnes.	\N	\N	2021-06-29 15:44:02.018+02	\N	\N	2021-06-29 15:44:02.02+02	2021-06-29 15:44:02.034+02	\N	42
1787	Une pénétration sans éjaculation peut parfois entraîner une grossesse ?	Oui, à cause du liquide pré-séminal qui nettoye et lubrifie le pénis. A l'état naturel, ce liquide ne contient pas de spermatozoïdes, mais il peut entraîner avec lui des spermatozoïdes qui étaient restés dans l'urètre depuis la dernière éjaculation : dans ce cas, une pénétration même sans éjaculation peut parfois entraîner une grossesse.	\N	\N	2021-06-29 15:44:02.241+02	\N	\N	2021-06-29 15:44:02.243+02	2021-06-29 15:44:02.256+02	\N	42
1788	On peut faire des bisous à une personne même si elle ne veut pas ?	Non, on ne peut pas. On ne peut pas faire des bisous à une personne qui ne le souhaite pas, même si c'est pour faire la bise. Chaque personne décide de ce dont elle a envie ou pas. Chaque personne a la maîtrise totale de son corps. Les autres doivent respecter les choix que cette personne fait.	\N	\N	2021-06-29 15:44:02.446+02	\N	\N	2021-06-29 15:44:02.448+02	2021-06-29 15:44:02.461+02	\N	38
1789	S'épiler le sexe, c'est quand même plus hygiénique, non ?	Non ! S'épiler est un choix personnel et ce n'est pas forcément plus hygiénique. Donc, chacun fait ce qu'il veut avec ses poils. L'important est de bien prendre soin de sa toilette intime, de l'hygiène de son corps et ses mains. \r\n(Attention, les poils ne protègent pas contre les infections sexuellement transmissibles !)	\N	\N	2021-06-29 15:44:02.604+02	\N	\N	2021-06-29 15:44:02.608+02	2021-06-29 15:44:02.632+02	\N	42
1790	Ne pas avoir de seins à 14 ans, est-ce normal ?	Oui c'est normal. Les seins commencent à se développer au moment de la puberté, qui débute en général entre 10 et 15 ans. Vers 18-19 ans, les seins prennent leur forme et leur taille adulte, mais chez certaines femmes ils varient encore par la suite. Si cela t'inquiète n'hésite pas en parler à ton infirmière scolaire, à ton médecin ou à une sage-femme.	\N	\N	2021-06-29 15:44:02.936+02	\N	\N	2021-06-29 15:44:02.94+02	2021-06-29 15:44:02.959+02	\N	38
1791	La libido c'est l'excitation sexuelle ?	Non, la libido, c'est le désir sexuel. C'est ce qui motive l'acte sexuel, c'est-à-dire qui donne envie d'avoir un acte sexuel (seul ou avec quelqu'un). Parfois, la libido n'est pas là alors qu'on aimerait qu'elle le soit. Si ça devient une gêne pour la vie sexuelle, on peut consulter un professionnel (psychologue, sexologue, médecin).	\N	\N	2021-06-29 15:44:03.213+02	\N	\N	2021-06-29 15:44:03.215+02	2021-06-29 15:44:03.229+02	\N	38
1792	Il faut dérouler le préservatif masculin AVANT de le poser sur le pénis ?	Non, car un préservatif déroulé ne peut plus être utilisé. Le préservatif masculin se déroule directement sur le pénis, du gland jusqu'à la base (du pénis). Petits conseils : choisir un préservatif adapté à sa taille, pincer le bout du préservatif (ou réservoir) pendant qu'on le déroule et ajouter du lubrifiant à l'extérieur pour faciliter la pénétration.	\N	\N	2021-06-29 15:44:03.375+02	\N	\N	2021-06-29 15:44:03.378+02	2021-06-29 15:44:03.396+02	\N	38
1793	C'est quoi une IST ?	C'est une Infection Sexuellement Transmissible (par la bouche, le vagin, le gland ou l'anus). On retrouve les chlamydias, la blennorragie (= chaude-pisse), la syphilis, l'hépatite B, l'herpès génital, le papillomavirus, le VIH/SIDA, et d'autres. Le préservatif est le meilleur moyen de s'en protéger. Les dépistages permettent de savoir si on est infecté ou non.	\N	\N	2021-06-29 15:44:03.583+02	\N	\N	2021-06-29 15:44:03.585+02	2021-06-29 15:44:03.595+02	\N	38
1794	Si un garçon ne bande pas, c'est qu'il n'a pas envie d'un rapport sexuel ?	Pas forcément. La relation entre érection, envie, désir est plus complexe : il peut y avoir des pannes d'érection du pénis qui n'ont rien à voir avec un manque d'excitation ou un manque d'envie. Le stress, l'anxiété ou la fatigue peuvent parfois expliquer ces "pannes". Si elles persistent, il est recommandé de s'adresser à un professionnel de santé.	\N	\N	2021-06-29 15:44:03.711+02	\N	\N	2021-06-29 15:44:03.713+02	2021-06-29 15:44:03.725+02	\N	40
1795	Il faut mettre un préservatif sur le sex toy au cours d'un rapport ?	Si on utilise un sex toy à plusieurs, il est important de mettre un préservatif par personne et par orifice (= trou). Il peut y avoir transmission d'IST. Si on l'utilise solo, on ne peut pas attraper d'IST mais des microbes s'il n'est pas bien lavé. Mieux vaut le laver avant/après chaque usage, à l'eau et au savon. Et faire la même chose pour ses mains :)	\N	\N	2021-06-29 15:44:03.879+02	\N	\N	2021-06-29 15:44:03.881+02	2021-06-29 15:44:03.893+02	\N	42
1796	La maladie de Lapeyronie cause des douleurs ou une gêne à l'érection ?	Oui. Les symptômes sont les suivants : déformation du pénis avec une courbure importante à l'érection, gêne et douleurs lors de l'érection, troubles sexuels ou impossibilité à la pénétration. Cette maladie n'est pas grave mais il est recommandé de consulter rapidement un médecin. Cette particularité encore méconnue toucherait 1 homme sur 12.	\N	\N	2021-06-29 15:44:04.114+02	\N	\N	2021-06-29 15:44:04.116+02	2021-06-29 15:44:04.131+02	\N	40
1797	L'éjaculation féminine c'est quoi ?	Une réalité et c'est tout à fait normal ! Certaines femmes éjaculent à chaque orgasme, d’autres plus rarement, certaines femmes jamais. Le liquide émis n'est pas de l'urine (la couleur, l'odeur, le goût sont différents) mais il sort un peu de la même manière. La quantité dépend de chaque femme, ce n’est pas forcément aussi abondant que dans les films pornos.	\N	\N	2021-06-29 15:44:04.349+02	\N	\N	2021-06-29 15:44:04.351+02	2021-06-29 15:44:04.362+02	\N	42
1798	La prostate fait partie de l'appareil génital ?	Oui, la prostate est une glande qui fait partie de l'appareil génital et reproducteur "masculin". Située sous la vessie et en avant de l'anus, elle sécrète une partie du liquide séminal (un des liquides qui composent le sperme). La stimulation de la prostate, depuis l'anus, peut donner du plaisir sexuel, voire un orgasme dit prostatique.	\N	\N	2021-06-29 15:44:04.552+02	\N	\N	2021-06-29 15:44:04.554+02	2021-06-29 15:44:04.574+02	\N	42
1799	Les préservatifs peuvent être prescrits par ordonnance et remboursés ?	Oui, le médecin ou la sage-femme peuvent prescrire les préservatifs "Eden" et "Sortez couverts". Ave une ordonnance et votre carte vitale, la boîte de 12 préservatifs masculins ne vous coûtera que 80 centimes (la sécurité sociale prend en charge 60% du prix). Le préservatif est le seul outil qui permet de se protéger des IST et d'éviter une grossesse.	\N	\N	2021-06-29 15:44:04.711+02	\N	\N	2021-06-29 15:44:04.713+02	2021-06-29 15:44:04.725+02	\N	42
1800	Un préservatif peut glisser et resté coincé dans le vagin ou dans l'anus ?	Oui, si le préservatif n'est pas déroulé jusqu'à la base, ou s'il est trop grand, ou si le préservatif est retiré quand le pénis est déjà mou et plus petit, le préservatif peut glisser et rester à l'intérieur du vagin ou de l'anus. Pas de panique, on peut le retirer avec les doigts.	\N	\N	2021-06-29 15:44:04.852+02	\N	\N	2021-06-29 15:44:04.855+02	2021-06-29 15:44:04.869+02	\N	42
1801	On peut fantasmer d'avoir des rapports gays ou lesbiens en étant hétéro ?	Oui, ça peut arriver, on peut avoir des fantasmes gays ou lesbiens, alors qu’on est hétéro, ou l'inverse. Quel que soit le fantasme, on n’a pas forcément envie que ça se réalise mais si on a envie de les réaliser et qu'on décide de les réaliser, attention à respecter la loi, le consentement, et à ne pas mettre en danger ses partenaires ou soi-même ;)	\N	\N	2021-06-29 15:44:05.086+02	\N	\N	2021-06-29 15:44:05.088+02	2021-06-29 15:44:05.101+02	\N	42
1802	Porter 2 préservatifs en même temps ça protège 2 fois plus ?	Non, il ne faut jamais utiliser deux préservatifs en même temps. Que ce soit deux préservatifs masculins ou un préservatif masculin et un préservatif féminin en même temps. Cela risque de les fragiliser ou de les déchirer et ainsi permettre la transmission d'infections sexuellement transmissibles ou une grossesse non désirée.	\N	\N	2021-06-29 15:44:05.209+02	\N	\N	2021-06-29 15:44:05.211+02	2021-06-29 15:44:05.225+02	\N	38
1803	Dans un rapport sexuel, il y a forcément une pénétration ?	Non, car un rapport sexuel ne veut pas forcément dire pénétration : une fellation, un cunnilingus, des caresses sexe contre sexe, la masturbation réciproque sont aussi considérés comme des rapports sexuels ! La sexualité ne se résume pas à la pénétration : il y a une grande diversité de pratiques.	\N	\N	2021-06-29 15:44:05.342+02	\N	\N	2021-06-29 15:44:05.344+02	2021-06-29 15:44:05.357+02	\N	40
1804	Le TROD VIH c'est quoi ?	Le test rapide d'orientation diagnostique (TROD) VIH permet de dépister le VIH. Avec une goutte de sang recueillie au bout du doigt, on a un résultat en 10 min. Son résultat est fiable à partir de 3 mois après la dernière prise de risque. Il est confidentiel et gratuit. <strong>A SLM, on peut le faire à la Croix-Rouge, au CeGIDD du CHOG et à l’association Aides.</strong>	\N	\N	2021-06-29 15:44:05.533+02	\N	\N	2021-06-29 15:44:05.535+02	2021-06-29 15:44:05.546+02	\N	42
1805	Est-ce qu'il faut se raser les poils autour du sexe ?	Non, il ne faut pas forcément se raser les poils autour du sexe. S'épiler est un choix personnel et ce n'est pas plus hygiénique. L'hygiène n'a rien à voir avec les poils. Chacun fait ce qu'il veut avec ses poils !	\N	\N	2021-06-29 15:44:05.738+02	\N	\N	2021-06-29 15:44:05.741+02	2021-06-29 15:44:05.752+02	\N	38
1806	Les chlamydia peuvent rendre stérile ?	Une infection à chlamydia non soignée peut provoquer la stérilité chez les femmes et les hommes. Elle se transmet lors de rapports non ou mal protégés. C'est l'IST la plus fréquente chez les jeunes et elle est souvent sans symptômes, d'où l'importance du dépistage. Pas de panique, détectée tôt, le traitement est efficace (à faire chez les deux partenaires).	\N	\N	2021-06-29 15:44:05.94+02	\N	\N	2021-06-29 15:44:05.942+02	2021-06-29 15:44:05.957+02	\N	42
1807	L'ouvrage original du Kamasutra recense combien de positions sexuelles ?	Le Kamasutra est un recueil indien qui parle des activités de la vie privée en Inde entre le VIe et le VIIe siècles. Il est mondialement connu car il montre et illustre une grande variété de pratiques et de positions sexuelles. L'ouvrage original recense 64 positions sexuelles, mais il existe beaucoup plus : on peut donc être créatif !	\N	\N	2021-06-29 15:44:06.16+02	\N	\N	2021-06-29 15:44:06.163+02	2021-06-29 15:44:06.176+02	\N	42
1808	Des parents qui forcent leur enfant à se marier, c'est illégal ?	Oui, les parents ne peuvent pas obliger leur enfant à se marier. La loi interdit de marier deux personnes qui ne le veulent pas.	\N	\N	2021-06-29 15:44:06.421+02	\N	\N	2021-06-29 15:44:06.423+02	2021-06-29 15:44:06.443+02	\N	40
1809	Porter 2 préservatifs en même temps ça protège 2 fois plus ?	Non, il ne faut jamais utiliser deux préservatifs en même temps. Que ce soit deux préservatifs masculins ou un préservatif masculin et un préservatif féminin en même temps. Cela risque de les fragiliser ou de les déchirer et ainsi permettre la transmission d'infections sexuellement transmissibles ou une grossesse non désirée.	\N	\N	2021-06-29 15:44:06.659+02	\N	\N	2021-06-29 15:44:06.661+02	2021-06-29 15:44:06.678+02	\N	40
1810	Une IVG c'est une infection vulvo-génitale ?	Une IVG est une Interruption Volontaire de Grossesse. Une personne enceinte qui ne souhaite pas poursuivre sa grossesse peut y avoir recours à condition de respecter les délais. Les IVG sont autorisées jusqu'à 12 semaines de grossesse et sont confidentielles. Elles sont gratuites pour les mineures et prises en charge à 100% pour les majeures.	\N	\N	2021-06-29 15:44:06.877+02	\N	\N	2021-06-29 15:44:06.881+02	2021-06-29 15:44:06.905+02	\N	38
1811	Une contraception est un moyen d'...	La contraception c’est l'ensemble des moyens qui permettent d'éviter de tomber enceinte lors d'une relation sexuelle. Les plus connus sont : préservatif, implant, stérilet, pilule mais il y en a d'autres. Parles en avec un médecin ou une sage-femme. Tumeplay t'offre une consultation et une contraception gratuite. Réponds au quiz et gagne ton coupon gratuit !	\N	\N	2021-06-29 15:44:07.129+02	\N	\N	2021-06-29 15:44:07.133+02	2021-06-29 15:44:07.157+02	\N	38
1812	Mineure, la pilule peut être prescrite sans l'autorisation des parents ?	Oui, le médecin ou la sage-femme peut prescrire la pilule ou une autre méthode contraceptive à une mineure, sans l’accord des parents. La consultation est confidentielle. La pilule peut être délivrée gratuitement et anonymement aux mineures à la PMI, dans un CeGIDD ou un CPEF, ou en pharmacie. Regarde notre carte pour trouver le lieu le plus proche de chez toi.	\N	\N	2021-06-29 15:44:07.378+02	\N	\N	2021-06-29 15:44:07.381+02	2021-06-29 15:44:07.394+02	\N	46
1813	Les pertes blanches peuvent sentir mauvais ?	Oui, les pertes blanches peuvent être malodorantes (sentir mauvais). Si les pertes blanches sont beaucoup plus abondantes que d'habitude, colorées ou malodorantes, qu'elles s'accompagnent de brûlures ou de démangeaisons, elles peuvent être le signe d'une infection. Dans ce cas, consulter un professionnel de santé.	\N	\N	2021-06-29 15:44:07.555+02	\N	\N	2021-06-29 15:44:07.558+02	2021-06-29 15:44:07.576+02	\N	38
1814	La pilule est le seul moyen de contraception existant ?	Non, il existe beaucoup de moyens de contraception différents ce qui permet à chacun de choisir sa solution la plus adaptée. Il y a par exemple les stérilets, les patchs, l'implant, l'anneau vaginal ou les préservatifs. Les préservatifs permettent en plus de se protéger des IST : attention à bien les utiliser.	\N	\N	2021-06-29 15:44:07.803+02	\N	\N	2021-06-29 15:44:07.805+02	2021-06-29 15:44:07.814+02	\N	38
1815	Les femmes peuvent avoir plusieurs orgasmes de suite ?	La plupart des femmes peuvent ressentir des orgasmes successifs (à la suite) qu'on appelle orgasmes multiples !	\N	\N	2021-06-29 15:44:08.05+02	\N	\N	2021-06-29 15:44:08.054+02	2021-06-29 15:44:08.075+02	\N	42
1816	Beaucoup de personnes qui disent « non » pensent « oui » ?	<strong>Non c'est non !</strong> Il peut arriver que l'autre insiste. Si malgré les refus, l'autre continue, ça peut être considéré comme une violence à caractère sexuel. Menacer avec des gestes ou des mots, négocier en faisant du chantage, parfois affectif, mentir pour avoir une relation sexuelle, ce n'est pas normal. Ces violences sexuelles sont punies par la loi.	\N	\N	2021-06-29 15:44:08.321+02	\N	\N	2021-06-29 15:44:08.322+02	2021-06-29 15:44:08.332+02	\N	42
1817	Faire une fellation ou un cunnilingus fait partie des fantasmes fréquents ?	Faire une fellation ou un cunnilingus fait partie des fantasmes habituels et fréquents. Les autres fantasmes les plus fréquents sont : avoir des rapports dans un lieu qui sort de l'ordinaire, essayer une nouvelle position ou pratique sexuelle, les sextos, les rapports de domination ou avoir des rapports sexuels avec plusieurs partenaires...	\N	\N	2021-06-29 15:44:08.52+02	\N	\N	2021-06-29 15:44:08.522+02	2021-06-29 15:44:08.534+02	\N	42
1818	Le VIH/SIDA peut se transmettre par la salive ?	Non, le VIH/SIDA ne se transmet pas par la salive. On ne peut pas donc pas le transmettre lors d'un baiser. Le VIH se transmet uniquement par le sperme, les sécrétions vaginales (mouille), le sang et le lait maternel.	\N	\N	2021-06-29 15:44:08.739+02	\N	\N	2021-06-29 15:44:08.742+02	2021-06-29 15:44:08.755+02	\N	40
1819	Les préliminaires c'est un moment très excitant et très agréable ?	Oui ! Les préliminaires peuvent prendre des formes très différentes (baisers, caresses, frottements, massages, striptease, fellation, cunnilingus, etc). L’excitation provoquée par les préliminaires favorise l’apparition de mouille chez la fille et du liquide pré-séminal chez le garçon. Ces deux liquides rendent la pénétration plus facile et plus agréable.	\N	\N	2021-06-29 15:44:09.016+02	\N	\N	2021-06-29 15:44:09.017+02	2021-06-29 15:44:09.03+02	\N	40
1820	Une fumeuse qui veut prendre la pilule doit en parler à son médecin ?	Oui, il faut le dire car certaines pilules posent problème quand on fume.  Le professionnel de santé te proposera alors une contraception adaptée : pilule spécifique, stérilet ou implant.	\N	\N	2021-06-29 15:44:09.151+02	\N	\N	2021-06-29 15:44:09.153+02	2021-06-29 15:44:09.163+02	\N	40
1821	La "pilule du lendemain" est une contraception d'urgence ?	Oui, ce n'est pas vraiment "du lendemain" car on peut la prendre jusque 3 à 5 jours après un rapport sexuel non protégé ou mal protégé (préservatif qui craque par exemple). ll faut la prendre le plus vite possible pour éviter de tomber enceinte. On peut la prendre plusieurs fois dans sa vie. Elle ne protège pas des infections sexuellement transmissibles.	\N	\N	2021-06-29 15:44:09.291+02	\N	\N	2021-06-29 15:44:09.292+02	2021-06-29 15:44:09.306+02	\N	40
1822	A ton avis, quelle est la taille du clitoris ?	Le clitoris dans son entier (le gland, le coude et les 4 ramifications) mesure en moyenne de 8 à 12 cm mais seul le gland est visible. Le gland mesure entre 0,5 et 1 cm. Le clitoris est le seul organe du corps humain dédié à 100% au plaisir ! Avec ses 8 000 terminaisons nerveuses (plus du double du pénis), il est très sensible à toutes les caresses.	\N	\N	2021-06-29 15:44:09.5+02	\N	\N	2021-06-29 15:44:09.502+02	2021-06-29 15:44:09.517+02	\N	38
